CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_iencuesta`(
  e_x_encuesta longtext)
BEGIN
   declare cnt int;
  declare ptr int;
  declare rowPtr varchar(100);
    
set cnt = (extractValue(e_x_encuesta, 'count(/Encuesta/Cliente)'));
set ptr = 0;
while ptr < cnt do
    SET ptr = ptr + 1;
    SET rowPtr = concat('/Encuesta/Cliente[', ptr, ']');
    INSERT INTO rec_m_encuesta (rec_idReclamo, pre_idPregunta, enc_idRespuesta, enc_numero, enc_texto, enc_fechaRegistro)
    values (extractValue(e_x_encuesta, concat(rowPtr, '/id_reclamo')),
            extractValue(e_x_encuesta, concat(rowPtr, '/id_pregunta')),
            extractValue(e_x_encuesta, concat(rowPtr, '/id_respuesta')),
            extractValue(e_x_encuesta, concat(rowPtr, '/respuesta_num')),
            extractValue(e_x_encuesta, concat(rowPtr, '/respuesta_txt')),
             NOW(3));

end while;
SELECT ptr;

END ;;
DELIMITER ;
