CREATE DEFINER=`root`@`%` PROCEDURE `pa_rec_cencargado`()
BEGIN
   select e.enc_idEncargado, e.enc_idProducto, p.pro_descripcion,  e.enc_idServicio,s.ser_descripcion,
           e.enc_idMotivo, m.mot_descripcion, e.enc_idRol, r.rol_rol
   from rec_r_encargado e
   inner join rec_m_servicios s on s.ser_idServicio = e.enc_idServicio
   inner join tb_rec_mae_productos p on p.pro_idProducto = e.enc_idProducto
   inner join tb_rec_mae_motivos m on m.mot_idMotivo = e.enc_idMotivo
   inner join tb_rec_mae_rol r on r.rol_idRol = e.enc_idRol
   order by e.enc_idEncargado desc;
END ;;
