CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_rec_cencuesta`(
e_idReclamo int,
e_idTipoPreg int)
BEGIN
	-- Recupera todas las respuestas para preguntas activas 
	SELECT 
		r.pre_idPregunta,
		p.pre_pregunta,
		r.res_idRespuesta,
		r.res_tipoRespuesta AS 'res_idTipoRespuesta',
		r.res_seleccion1,
		r.res_seleccion2,
		r.res_seleccion3,
		r.res_seleccion4
	FROM rec_d_respuesta AS r
	JOIN rec_m_pregunta AS p ON p.pre_idPregunta = r.pre_idPregunta
	LEFT JOIN TB_REC_DET_Catalogos AS c ON r.res_tipoRespuesta = c.cat_idCatalogo
	LEFT JOIN TB_REC_DET_Catalogos AS c1 ON p.pre_tipoPregunta = c1.cat_idCatalogo
	LEFT JOIN tb_rec_mae_reclamos AS rec ON rec.rec_idReclamo = e_idReclamo
		AND (p.pre_idProducto = rec.rec_idProducto or p.pre_idProducto = 0)
		AND (p.pre_idServicio = rec.rec_idServicio or p.pre_idServicio = 0)
		AND (p.pre_idMotivo = rec.rec_idMotivo or p.pre_idMotivo = 0)
	WHERE p.pre_TipoPregunta = e_idTipoPreg
	AND p.pre_estado = '1'
	AND r.res_estado = '1';

END ;;
DELIMITER ;
