CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_rec_cmotivos_tipo`()
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

-- SQLINES LICENSE FOR EVALUATION USE ONLY
select 
	m.mot_idMotivo,
	m.mot_idProducto,
	m.mot_descripcion,
	concat_ws(' - ', p.pro_tipo, s.ser_descripcion) as ser_descripcion,
	m.mot_estado,
	m.mot_usuarioRegistro,
	m.mot_ipRegistro,
	m.mot_fechaRegistro, 
	m.mot_usuarioModificacion,
	m.mot_ipModificacion,
	m.mot_fechaModificacion,
	m.mot_DiasMaximo,
    m.mot_DiasSuper
from TB_REC_MAE_Motivos m
inner join rec_m_servicios s on s.ser_idServicio = m.mot_idProducto 
left join tb_rec_mae_productos p on  p.pro_idProducto = s.pro_idProducto
order by m.mot_idProducto;

END ;;
