CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_rec_crepEncuesta`(
e_fecha_ingreso     datetime(3) /* = null */,
e_fecha_fin     datetime(3) /* = null */,
e_cod_reclamo varchar(30),
e_id_resolucion int, 
e_id_pregunta int)
BEGIN
declare v_pregunta int;
declare v_resolucion int;
declare v_cod_reclamo varchar(30);

	if e_id_pregunta is null or e_id_pregunta = 0 then
		set v_pregunta = null;
	else
		set v_pregunta = e_id_pregunta;
	end if;
	if e_id_resolucion is null or e_id_resolucion = 0 then
		set v_resolucion = null;
	else
		set v_resolucion = e_id_resolucion;
	end if;
    if e_cod_reclamo is null or e_cod_reclamo = '' then
		set v_cod_reclamo = null;
	else
		set v_cod_reclamo = e_cod_reclamo;
	end if;

	select 
	e.enc_fechaRegistro as fecha,
	rec.rec_codigoReclamo as codigoReclamo,
	rec.rec_nombre_Cliente as Cliente,
	p.pre_idPregunta,
	p.pre_pregunta,
	(select c.cat_descripciÃ³n from TB_REC_DET_Catalogos c where rec.rec_FavorableDesfavorable = c.cat_idCatalogo) as resolucion,
	r.res_idRespuesta,
	(CASE r.res_tipoRespuesta
	   when 94 then e.enc_numero
	   when 95 then e.enc_texto
	   when 96 then 
	   (CASE e.enc_idRespuesta
	   when 1 then r.res_seleccion1
	   when 2 then r.res_seleccion2
	   when 3 then r.res_seleccion3
	   when 4 then r.res_seleccion4 
	   ELSE r.res_seleccion2 END)
	   ELSE NULL
	END) as respuesta
	from rec_m_encuesta e
	INNER JOIN  rec_m_pregunta p ON p.pre_idPregunta = e.pre_idPregunta
	AND p.pre_estado='1'
	INNER JOIN rec_d_respuesta r ON r.pre_idPregunta = p.pre_idPregunta
	AND r.res_estado='1'
	INNER JOIN TB_REC_MAE_Reclamos rec on e.rec_idReclamo = rec.rec_idReclamo
	AND rec.rec_codigoReclamo = IFNULL(v_cod_reclamo, rec.rec_codigoReclamo)
    AND rec.rec_FavorableDesfavorable = IFNULL(v_resolucion, rec.rec_FavorableDesfavorable)
	WHERE e.enc_fechaRegistro between e_fecha_ingreso and e_fecha_fin
	AND e.pre_idPregunta = IFNULL(v_pregunta, e.pre_idPregunta)
	order by rec.rec_idReclamo, p.pre_idPregunta asc;

END ;;
DELIMITER ;
