CREATE DEFINER=`root`@`%` PROCEDURE `pa_rec_creporteFormularioAsesor`(p_idReclamo int)
BEGIN
SELECT 
    r.rec_idReclamo,
    r.rec_nombre_Cliente,
    CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
    CAST(AES_DECRYPT(rec_codigoOperacion, 'Pa$$')AS CHAR(100)) as rec_codigoOperacion,
    CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
    ( SELECT p.pro_descripcion
		                    FROM TB_REC_MAE_Productos P
		                   WHERE p.pro_idProducto = r.rec_idProducto
						     AND P.pro_estado = 1) as pro_descripcion,
	( SELECT s.ser_descripcion
		                    FROM rec_m_servicios s
		                   WHERE s.ser_idServicio = r.rec_idServicio
						     AND s.ser_estado = 1) as ser_descripcion,
 (SELECT m.mot_descripcion
		                 FROM TB_REC_MAE_Motivos m
						WHERE m.mot_idMotivo = r.rec_idMotivo
						  AND m.mot_estado = 1) as mot_descripcion,
     (select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_canal
						  and tc.tca_idTipoCatalogo =  19) as rec_canal,
    r.rec_fechaProblema,
    r.rec_fechaSolucionReclamo,
    r.rec_montoDevolucion,
    r.rec_FechaIngreso,
    r.rec_fechaEstimadaSolucion,
	r.rec_DetalleReclamo,
    r.rec_peticiÃ³nConcreta,
    r.rec_CiudadOficinaReclamo,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado =1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoReclamo
						  and tc.tca_idTipoCatalogo = 1 ) as desEstadoReclamo,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco 
						  and tc.tca_idTipoCatalogo = 6 )as desEstadoTiempoBanco,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_id_forma_devolucion
						  and tc.tca_idTipoCatalogo = 18 ) as desFormaDevolucion
    from TB_REC_MAE_Reclamos r
        -- TB_REC_DET_detallesReclamos dr
    where /*dr.det_idReclamo = r.rec_idReclamo
      and*/ r.rec_idReclamo = p_idReclamo
	  -- and dr.det_estado    = 1
	  and r.rec_idProducto <> 0;
END ;;
DELIMITER ;
