CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_rec_crespuesta`(
e_opcion int ,
e_id_respuesta int )
BEGIN

  	if e_opcion = 1
	THEN
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
        -- Recupera todas las respuestas para preguntas activas
		SELECT 
			r.res_idRespuesta,
            r.res_tipoRespuesta AS 'res_idTipoRespuesta',
			c.cat_descripciÃ³n AS 'res_tipoRespuesta',
			r.res_estado,
			r.pre_idPregunta AS 'res_idPregunta',
			p.pre_tipoPregunta AS 'pre_idTipoPregunta',
            c1.cat_descripciÃ³n AS 'pre_tipoPregunta',
            p.pre_resolucion AS 'pre_idResolucion',
            c2.cat_descripciÃ³n AS 'pre_resolucion',
			p.pre_pregunta AS 'pre_descripcion',
            p.pre_idProducto AS 'pro_idProducto',
			pr.pro_descripcion AS 'pro_descripcion',
            p.pre_idServicio AS 'ser_idServicio',
			s.ser_descripcion AS 'ser_descripcion',
            p.pre_idMotivo AS 'mot_idMotivo',
			m.mot_descripcion AS 'mot_descripcion',
			CONCAT_WS(',', r.res_seleccion1, r.res_seleccion2, r.res_seleccion3, r.res_seleccion4)  AS 'respuesta'
		FROM rec_d_respuesta AS r
		JOIN rec_m_pregunta AS p ON p.pre_idPregunta = r.pre_idPregunta
        LEFT JOIN TB_REC_DET_Catalogos AS c ON r.res_tipoRespuesta = c.cat_idCatalogo
        LEFT JOIN TB_REC_DET_Catalogos AS c1 ON p.pre_tipoPregunta = c1.cat_idCatalogo
        LEFT JOIN TB_REC_DET_Catalogos AS c2 ON p.pre_resolucion = c2.cat_idCatalogo
		LEFT JOIN TB_REC_MAE_productos AS pr ON p.pre_idProducto = pr.pro_idProducto
		LEFT JOIN REC_M_SERVICIOS AS s ON p.pre_idServicio = s.ser_idServicio 
		LEFT JOIN TB_REC_MAE_motivos AS m ON p.pre_idMotivo = m.mot_idMotivo 
		WHERE p.pre_estado = '1';
	END IF;
	if e_opcion = 2
	THEN
		
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
        -- Recupera una respuesta especificada por p_idRespuesta
		SELECT 
			r.res_idRespuesta,
            r.res_tipoRespuesta AS 'res_idTipoRespuesta',
			c.cat_descripciÃ³n AS 'res_tipoRespuesta',
			r.res_estado,
			r.pre_idPregunta AS 'res_idPregunta',
			p.pre_tipoPregunta AS 'pre_idTipoPregunta',
            c1.cat_descripciÃ³n AS 'pre_tipoPregunta',
			p.pre_pregunta AS 'pre_descripcion',
			pr.pro_descripcion,
			s.ser_descripcion,
			m.mot_descripcion,
            r.res_seleccion1,
            r.res_seleccion2,
            r.res_seleccion3,
            r.res_seleccion4
		FROM rec_d_respuesta AS r
		JOIN rec_m_pregunta AS p ON p.pre_idPregunta = r.pre_idPregunta
        LEFT JOIN TB_REC_DET_Catalogos AS c ON r.res_tipoRespuesta = c.cat_idCatalogo
        LEFT JOIN TB_REC_DET_Catalogos AS c1 ON p.pre_tipoPregunta = c1.cat_idCatalogo
		LEFT JOIN TB_REC_MAE_productos AS pr ON p.pre_idProducto = pr.pro_idProducto
		LEFT JOIN REC_M_SERVICIOS AS s ON p.pre_idServicio = s.ser_idServicio AND pr.pro_idProducto = s.pro_idProducto
		LEFT JOIN TB_REC_MAE_motivos AS m ON p.pre_idMotivo = m.mot_idMotivo AND pr.pro_idProducto = m.mot_idProducto
		WHERE p.pre_estado = '1'
			AND r.res_idRespuesta = e_id_respuesta;
	END IF;

END ;;
DELIMITER ;
