CREATE DEFINER=`root`@`%` PROCEDURE `pa_rec_cruta_historica`()
BEGIN
   DECLARE v_dias    int DEFAULT null;
BEGIN
   SET v_dias = (select cat.cat_valor1 from TB_REC_DET_Catalogos cat where cat.cat_idCatalogo = 87);
   select r.rec_idReclamo, r.rec_codigoReclamo,r.rec_formulario, r.rec_fechaRegistro  from tb_rec_mae_reclamos r
   inner join tb_rec_det_imagenesoficial deto on  deto.imo_idReclamo = r.rec_idReclamo
where  DATE_ADD(CONVERT (r.rec_fechaRegistro, date), Interval v_dias day)< CONVERT (NOW(3), date);
END;
END ;;
