CREATE DEFINER=`root`@`%` PROCEDURE `pa_rec_cservcampo_tre`(e_tipoReclamo bigint)
BEGIN
select pr.pro_idProducto, pr.pro_descripcion, se.ser_idServicio, se.ser_descripcion , mo.mot_idMotivo, 
mo.mot_descripcion, ca.ca_codigo, ca.ca_descripcion, ca.ca_emonico, ca.ca_tipo, ca.ca_tipo2, ca.ca_longitud,
ca.ca_obligatorio from rec_d_serv_campo sc
join rec_m_campo ca on sc.ca_codigo = ca.ca_codigo
join tb_rec_mae_motivos  mo on mo.mot_idMotivo = sc.mot_idMotivo
join rec_m_servicios se on se.ser_idServicio = mo.mot_idProducto
join tb_rec_mae_productos pr on pr.pro_idProducto = se.pro_idProducto
where sc.mot_idMotivo = e_tipoReclamo;
END ;;
