BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;
SELECT
	mot_idMotivo,
	mot_idProducto ser_idServicio,
	mot_descripcion,
	p.ser_descripcion,
	mot_estado,
	mot_usuarioRegistro,
	mot_ipRegistro,
	mot_fechaRegistro,
	mot_usuarioModificacion,
	mot_ipModificacion,
	mot_fechaModificacion,
	m.mot_idTipoMotivo,
    (select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = m.mot_idTipoMotivo
						  and tc.tca_idTipoCatalogo = 20) as TipoMotivo,
	m.mot_DiasMaximo
FROM
	TB_REC_MAE_Motivos m
inner join rec_m_servicios p on m.mot_idProducto = p.ser_idServicio
	AND m.mot_idProducto = e_idservicio
 order by mot_descripcion asc;

END ;;
