CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_rec_imasivos`(
  e_x_reclamos longtext,
  e_usuario varchar(50),
  e_ip varchar(15))
BEGIN
	declare cnt int;
	declare ptr int;
	declare rowPtr varchar(100);
	declare cont_r int;
	declare i int;
	declare v_indice int;
	declare v_identificacion VARCHAR(50);
	declare v_nombres VARCHAR(200);
	declare	v_telefono VARCHAR(50);
	declare v_telefono2 VARCHAR(50);
	declare v_correo VARCHAR(200);
	declare  v_provincia VARCHAR(50);
	declare	v_ciudad VARCHAR(50);
	declare v_direccion VARCHAR(100); 
	declare v_segmento VARCHAR(3);
	declare v_producto VARCHAR(200);
	declare v_servicio VARCHAR(200);
    declare v_motivo VARCHAR(200); 
    declare v_origen VARCHAR(50); 
    declare v_canal VARCHAR(50);
	declare v_monto VARCHAR(50);
    declare v_oficina VARCHAR(50);
    declare v_hechos longtext;
    declare v_peticion longtext;
	declare v_fecha VARCHAR(50);  
    declare v_idproducto int;
    declare v_idservicio int;
    declare v_idmotivo int;
    declare diasSuper int;
    declare diasMax int;
    declare v_idorigen int;
    declare v_idcanal int;
    declare v_idoficina int;
    declare v_prioridad int;

	DROP TABLE IF EXISTS reclamos_masivos;
	CREATE TEMPORARY TABLE reclamos_masivos ( 
		indice int, identificacion VARCHAR(50) NOT NULL, nombres VARCHAR(200) NOT NULL, telefono VARCHAR(50) NOT NULL, telefono2 VARCHAR(50),
        correo VARCHAR(200) NOT NULL, provincia VARCHAR(50) NOT NULL, ciudad VARCHAR(50) NOT NULL, direccion VARCHAR(100) NOT NULL, 
        segmento VARCHAR(3) NOT NULL, producto VARCHAR(200), servicio VARCHAR(200), motivo VARCHAR(200), origen VARCHAR(50) NOT NULL, 
        canal VARCHAR(50), monto VARCHAR(50) NOT NULL, oficina VARCHAR(50) NOT NULL, hechos VARCHAR(500) NOT NULL, peticion VARCHAR(500) NOT NULL,
		fecha VARCHAR(50) NOT NULL ) ENGINE=MEMORY;
  
	set cnt = (extractValue(e_x_reclamos, 'count(/Masivos/Reclamo)'));
	set ptr = 0;
	while ptr < cnt do
		SET ptr = ptr + 1;
		SET rowPtr = concat('/Masivos/Reclamo[', ptr, ']');
		INSERT INTO reclamos_masivos (indice, identificacion, nombres, telefono, telefono2, correo, provincia, ciudad, direccion, segmento,
									producto, servicio, motivo, origen, canal, monto, oficina, hechos, peticion, fecha)
		values (ptr, extractValue(e_x_reclamos, concat(rowPtr, '/identificacion')), extractValue(e_x_reclamos, concat(rowPtr, '/nombres')),
				extractValue(e_x_reclamos, concat(rowPtr, '/telefono')), extractValue(e_x_reclamos, concat(rowPtr, '/telefono2')),
				extractValue(e_x_reclamos, concat(rowPtr, '/correo')), extractValue(e_x_reclamos, concat(rowPtr, '/provincia')),
				extractValue(e_x_reclamos, concat(rowPtr, '/ciudad')), extractValue(e_x_reclamos, concat(rowPtr, '/direccion')),
				extractValue(e_x_reclamos, concat(rowPtr, '/segmento')), extractValue(e_x_reclamos, concat(rowPtr, '/producto')),
				extractValue(e_x_reclamos, concat(rowPtr, '/servicio')), extractValue(e_x_reclamos, concat(rowPtr, '/motivo')),
				extractValue(e_x_reclamos, concat(rowPtr, '/origen')), extractValue(e_x_reclamos, concat(rowPtr, '/canal')),
				extractValue(e_x_reclamos, concat(rowPtr, '/monto')), extractValue(e_x_reclamos, concat(rowPtr, '/oficina')),
				extractValue(e_x_reclamos, concat(rowPtr, '/hechos')), extractValue(e_x_reclamos, concat(rowPtr, '/peticion')),
				extractValue(e_x_reclamos, concat(rowPtr, '/fecha')));
	end while;

	select count(*) INTO cont_r from reclamos_masivos;
	set i = 0;
	while i < cont_r do 
		SET i = i + 1;
		select * INTO v_indice, v_identificacion, v_nombres, v_telefono, v_telefono2, v_correo, v_provincia, 
									v_ciudad, v_direccion, v_segmento, v_producto, v_servicio, v_motivo, v_origen, v_canal, 
									v_monto, v_oficina, v_hechos, v_peticion, v_fecha from reclamos_masivos where indice = i;
	    -- obtener producto
        select p.pro_idProducto into v_idproducto from tb_rec_mae_productos p where upper(p.pro_descripcion) like '%'||v_producto||'%' limit 1;
        select s.ser_idServicio into v_idservicio from rec_m_servicios s where upper(s.ser_descripcion) like '%'||v_servicio||'%' limit 1;
        select m.mot_idMotivo, m.mot_DiasSuper, m.mot_DiasMaximo into v_idmotivo, diasSuper, diasMax 
        from tb_rec_mae_motivos m where upper(m.mot_descripcion) like '%'||v_motivo||'%' limit 1;
        select c.cat_idCatalogo into v_idorigen from tb_rec_det_catalogos c where c.cat_idTipoCatalogo = 3 and upper(c.cat_descripciÃ³n) like '%'||v_origen||'%' limit 1;
        select c.cat_idCatalogo into v_idcanal from tb_rec_det_catalogos c where c.cat_idTipoCatalogo = 19 and upper(c.cat_descripciÃ³n) like '%'||v_canal||'%' limit 1;
        select o.ofi_codOficina, o.ofi_oficina into v_idoficina, v_oficina from rec_m_oficina o where o.ofi_oficina like '%'||v_oficina||'%' limit 1;
        select c.cat_valor1 INTO v_prioridad FROM rec_p_segmento s, tb_rec_det_catalogos c WHERE s.seg_codigo = SUBSTR(v_segmento, 1, 1) AND s.seg_id_prioridad = c.cat_idCatalogo;
		
        INSERT INTO TB_REC_MAE_Reclamos (
			rec_idProducto, rec_idServicio, rec_idMotivo, rec_FechaIngreso, rec_fechaEstimadaSolucion, 
			rec_fechaEstimadaSolucionSBE, rec_origen, rec_tipoPersona, rec_IdentificacionCliente, rec_nombre_Cliente, rec_codigoOficialCuenta, rec_nombreOficialCuenta,
			rec_Telefono1, rec_Telefono2, rec_direccion, rec_provincia, rec_Ciudad, rec_numeroOficinaReclamo, rec_nombreOficinaReclamo, rec_Monto,
			rec_Correo, rec_numeroOficinaOrigenReclamo, rec_nombreOficinaOrigenReclamo, rec_DetalleReclamo, rec_peticiÃ³nConcreta, rec_EstadoReclamo,
			rec_EstadoTiempoBanco, rec_TiempoAtencionBanco, rec_EstadoTiempoSBE, rec_TiempoAtencionSBE, rec_diasSBE, rec_plazoNormativa,
			rec_usuarioRegistro, rec_ipRegistro, rec_fechaRegistro, rec_canal, rec_fechaVencimiento, rec_segmento, rec_prioridad
		) VALUES (
			IFNULL(v_idproducto, 1), IFNULL(v_idservicio, 1), IFNULL(v_idmotivo, 1), NOW(3), DATE_ADD(NOW(3), interval diasMax day), 
            DATE_ADD(NOW(3), interval diasSuper day), IFNULL(v_idorigen, 10), 41, AES_ENCRYPT(v_identificacion, 'Pa$$'), v_nombres, 0, "", 
			v_telefono, v_telefono2, v_direccion, v_provincia, v_ciudad, IFNULL(v_idoficina, 0), IFNULL(v_oficina, 'MATRIZ'), v_monto,
			AES_ENCRYPT(v_correo, 'Pa$$'), IFNULL(v_idoficina, 0), IFNULL(v_oficina, 'MATRIZ'), v_hechos, v_peticion, 7, 
            0, diasMax, 0, diasSuper, diasSuper, diasSuper,
            e_usuario, e_ip, NOW(3), v_idcanal, DATE_ADD(NOW(3), interval diasMax day), v_segmento, IFNULL(v_prioridad, 1)
		);
	END WHILE; 
    
	DROP TABLE reclamos_masivos;

END ;;
