CREATE DEFINER=`root`@`%` PROCEDURE `p_rec_cnotificaproducto`(
    e_id_producto 	int,		/* ID  a buscar */
    e_identificacion varchar(13),
    OUT s_notifica_producto int
)
BEGIN
declare producto_notifica int ;
declare cant_notifica int;

	SELECT p.pro_cant_mail_e  INTO producto_notifica
	FROM tb_rec_mae_productos p WHERE p.pro_idProducto = e_id_producto;

	IF IFNULL(producto_notifica, 0) > 0 THEN
		SELECT count(*) INTO cant_notifica
		FROM  tb_rec_mae_reclamos r 
		WHERE AES_DECRYPT(r.rec_IdentificacionCliente, 'Pa$$') = IFNULL(e_identificacion, AES_DECRYPT(r.rec_IdentificacionCliente, 'Pa$$')) 
		AND r.rec_idProducto = 2
		AND r.rec_FechaIngreso between DATE_SUB(sysdate(), interval 30 day) and sysdate()
        AND r.rec_linkEncuesta is not null;
	END IF;
    
    IF IFNULL(cant_notifica, 0) > IFNULL(producto_notifica, 0) THEN
		SET  s_notifica_producto = cant_notifica;
	ELSE 
		SET s_notifica_producto = 0;
	END IF;
END ;;
DELIMITER ;
