CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_CamposProductosConcat`()
BEGIN

 
DECLARE NOT_FOUND INT DEFAULT FALSE; 	
DECLARE v_valores VARCHAR(1000);
DECLARE v_tipo    int DEFAULT null;
DECLARE v_descripcion varchar(1000);
DECLARE v_idProductoCampo bigint DEFAULT null;
DECLARE v_estado_detCam varchar(50);


DECLARE c_Det_ProductoCampos CURSOR FOR   
 SELECT  distinct pc.pc_idProducto, p.pro_descripcion,pc.pc_estado
 FROM TB_REC_DET_ProductosCampos pc
 inner join TB_REC_MAE_Productos p on pc.pc_idProducto = p.pro_idProducto;
 
DECLARE CONTINUE HANDLER FOR NOT FOUND SET NOT_FOUND = TRUE;
BEGIN


    create temporary table temp (
    tipo int null,
    cadena varchar(1000),
	descripcion varchar(1000),
	estado_detCam varchar(50)
    );
    OPEN c_Det_ProductoCampos;  
    FETCH c_Det_ProductoCampos   
    INTO v_tipo, v_descripcion,v_estado_detCam;
      
    WHILE NOT_FOUND = false
    DO 
    
    set v_valores = null;
       -- SQLINES LICENSE FOR EVALUATION USE ONLY
       set v_valores = 
						(
						select  GROUP_CONCAT(A.cam_descripcion)
						from
						(select pc.pc_idProducto, p.pro_descripcion,pc.pc_idCampo, c.cam_descripcion
								FROM TB_REC_DET_ProductosCampos pc
								inner join TB_REC_MAE_Campos c on pc.pc_idCampo = c.cam_idCampo 
								inner join TB_REC_MAE_Productos p on pc.pc_idProducto = p.pro_idProducto
								and pc.pc_idProducto = v_tipo
								
								and pc.pc_estado='A' 
								) as A);
    
      -- select @valores
       insert into temp values(v_tipo,v_valores, v_descripcion,v_estado_detCam);
       FETCH c_Det_ProductoCampos INTO v_tipo, v_descripcion,v_estado_detCam;  
    
    END WHILE; 
          
    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    SELECT 
	    null as pc_idProductosCampos,-- SQLINES DEMO *** mpos],
        pc.pro_idProducto as pc_idProducto,
		t.descripcion as pro_descripcion,--  SQLINES DEMO *** pro_descripcion,
    	t.cadena,
    	null as pc_idCampo,-- SQLINES DEMO *** pc_idCampo,
		null as cam_etiqueta,
		t.estado_detCam as pc_estado    
	FROM  TB_REC_MAE_Productos pc ,  temp t
	where pc.pro_idProducto= t.tipo
	and t.estado_detCam = 'A'
	order by pc.pro_idProducto;

    drop table temp; 
    CLOSE c_Det_ProductoCampos;  
END;
END ;;
DELIMITER ;
