CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_DatosFormulario`(
	p_idReclamo int)
BEGIN
   
	
	SELECT `rec_idReclamo`
	  ,`rec_codigoReclamo`
      ,IFNULL(r.rec_idProducto,0) AS 'rec_idProducto'
      ,IFNULL(r.rec_idServicio,0) AS 'rec_idServicio'
      ,IFNULL(r.rec_idMotivo,0) AS 'rec_idMotivo'
      ,p.pro_descripcion  
      ,m.mot_descripcion
      ,ser_descripcion
      ,`rec_FechaIngreso`      
      ,c.cat_descripciÃ³n	
      ,CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente
      ,`rec_nombre_Cliente`
      ,`rec_nombreOficialCuenta`
      ,`rec_Telefono1`
      ,`rec_Telefono2` 
	  ,`rec_TelefonoOficial`
      ,`rec_direccion`
      ,`rec_provincia`
      ,`rec_Ciudad`               
      ,`rec_nombreOficinaReclamo`
	  ,`rec_CiudadOficinaReclamo`
      ,`rec_Monto`    
      ,CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo
      ,CAST(AES_DECRYPT(rec_codigoOperacion, 'Pa$$')AS CHAR(100)) as rec_codigoOperacion
      ,`rec_DetalleReclamo`
      ,`rec_peticiÃ³nConcreta`
	  ,`rec_defensor`
      ,( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_canal
						  and tc.tca_idTipoCatalogo = 19) as rec_canal
	  ,`rec_idTipoMotivo`
	  ,`rec_fechaVencimiento`
	            
   FROM TB_REC_MAE_Reclamos r 
  inner join TB_REC_MAE_Productos p  on r.rec_idProducto = p.pro_idProducto
  inner join TB_REC_MAE_Motivos m on r.rec_idMotivo = m.mot_idMotivo
  inner join TB_REC_DET_Catalogos c on r.rec_tipoPersona = c.cat_idCatalogo
  inner join rec_m_servicios s on s.ser_idServicio =r.rec_idServicio
  where r.rec_idReclamo = p_idReclamo; 
	
END ;;
