CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_DatosFormularioWEB`(
	p_idReclamo int /* = null */,
    p_identificacion varchar(50) /* = null */)
BEGIN
DECLARE v_id int;

BEGIN
	IF(IFNULL(p_idReclamo, 0) <> 0)
	  THEN
		SET  v_id = p_idReclamo;
	  END IF;

	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT `rec_idReclamo`
	  ,`rec_codigoReclamo`
	  ,r.rec_idProducto
      ,p.pro_descripcion    
	  ,r.rec_idMotivo
	  ,m.mot_descripcion
      ,`rec_FechaIngreso`	
	  ,r.rec_tipoPersona
	  ,c.cat_descripciÃ³n as desTipoPersona   
      ,CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente
      ,`rec_nombre_Cliente`
      ,`rec_nombreOficialCuenta`
      ,`rec_Telefono1`
      ,`rec_Telefono2` 
	  ,`rec_TelefonoOficial`
      ,`rec_direccion`
      ,`rec_provincia`
      ,`rec_Ciudad`               
      ,`rec_nombreOficinaReclamo`
	  ,`rec_CiudadOficinaReclamo`
      ,`rec_Monto`    
      ,CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo
      ,c3.cat_descripciÃ³n as rec_EstadoReclamo	            
      ,`rec_DetalleReclamo`
      ,`rec_peticiÃ³nConcreta` 
      ,CAST(AES_DECRYPT(rec_codigoOperacion, 'Pa$$')AS CHAR(100)) as rec_codigoOperacion
	  ,r.rec_origen  
	  ,c2.cat_descripciÃ³n as desOrigen
	  ,r.rec_lineaNegocio
	  ,IFNULL(r.rec_FavorableDesfavorable, 0) as rec_FavorableDesfavorable
      ,r.rec_linkEncuesta
   FROM TB_REC_MAE_Reclamos r 
  inner join TB_REC_MAE_Productos p  on r.rec_idProducto = p.pro_idProducto
  inner join TB_REC_MAE_Motivos m on r.rec_idMotivo = m.mot_idMotivo
  inner join TB_REC_DET_Catalogos c on r.rec_tipoPersona = c.cat_idCatalogo
  inner join TB_REC_DET_Catalogos c2 on r.rec_origen = c2.cat_idCatalogo
  inner join TB_REC_DET_Catalogos c3 on r.rec_EstadoReclamo = c3.cat_idCatalogo
  where r.rec_idReclamo =  IFNULL(v_id, r.rec_idReclamo) 
  and AES_DECRYPT(r.rec_IdentificacionCliente, 'Pa$$') = IFNULL(p_identificacion, AES_DECRYPT(r.rec_IdentificacionCliente, 'Pa$$')) 
  and IFNULL(r.rec_estaAgrupado, 0) = 0; 
	  
END;


END ;;
