CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_DetalleSolucionador`(
	p_Solucionador bigint /* = null */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
   
    

    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    SELECT 
	r.rec_idReclamo,
    rec_codigoReclamo as codigo,
    p.pro_descripcion,
    m.mot_descripcion,
    r.rec_nombre_Cliente,
    r.rec_FechaIngreso,
    r.rec_fechaEstimadaSolucion,
	dr.det_estadoReclamo as rec_EstadoReclamo,-- r.rec_EstadoReclamo,
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo =  dr.det_estadoReclamo
						  and tc.tca_idTipoCatalogo = 1 ) as desEstadoReclamo,
	r.rec_EstadoTiempoBanco,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco 
						  and tc.tca_idTipoCatalogo = 6 ),
	r.rec_fechaSolucionReclamo,
	r.rec_usuarioModificacion,
	r.rec_id_forma_devolucion,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_id_forma_devolucion 
						  and tc.tca_idTipoCatalogo = 18 ), desEstadoTiempoBanco, desFormaDevolucion
    from TB_REC_MAE_Reclamos r, 
         TB_REC_MAE_Productos p,
         TB_REC_MAE_Motivos m,
         TB_REC_DET_detallesReclamos dr
    where r.rec_idProducto = p.pro_idProducto
      and r.rec_idMotivo = m.mot_idMotivo
      and dr.det_idReclamo = r.rec_idReclamo
      and dr.det_idSolucionador = p_Solucionador 
	  and dr.det_estado = 1;
    -- SQLINES DEMO *** Reclamo = @estado

END ;;
