CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_DetSolucionadorByEstado`(
	p_id_solucionador int /* = null */,
	p_id_estado  int /* = null */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
    

   if p_id_estado = 0 THEN
	     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     	SELECT 
        r.rec_idReclamo,
	    r.rec_codigoReclamo as codigo,       
        ( SELECT p.pro_descripcion
	    	                    FROM TB_REC_MAE_Productos P
	    	                   WHERE p.pro_idProducto = r.rec_idProducto
	    					     AND P.pro_estado = 1) as pro_descripcion,
	    -- p.pro_descripcion,
	    (SELECT m.mot_descripcion
	    	                 FROM TB_REC_MAE_Motivos m
	    					WHERE m.mot_idMotivo = r.rec_idMotivo
	    					  AND m.mot_estado = 1) as mot_descripcion,
        -- m.mot_descripcion,
        r.rec_nombre_Cliente,
        r.rec_FechaIngreso,
        r.rec_fechaEstimadaSolucion,
	    dr.det_estadoReclamo as rec_EstadoReclamo,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado =1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = dr.det_estadoReclamo
	    					  and tc.tca_idTipoCatalogo = 1 ) as desEstadoReclamo,
	    r.rec_EstadoTiempoBanco,
		rec_formulario,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco 
	    					  and tc.tca_idTipoCatalogo = 6 ) as desEstadoTiempoBanco, 
	    dr.det_idSolucionador,
		det_estadoReclamo,
		det_estado,
		r.rec_solucionador as rec_usuarioModificacion,
		r.rec_fechaSolucionReclamo,
		r.rec_id_forma_devolucion,
	 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_id_forma_devolucion
						  and tc.tca_idTipoCatalogo = 18 ) as desFormaDevolucion,
                          (select seg.seg_segmento from rec_p_segmento seg where seg.seg_id_segmento = r.rec_prioridad) as desPrioridad
			
    from TB_REC_MAE_Reclamos r, 
         TB_REC_DET_detallesReclamos dr
    where dr.det_idReclamo = r.rec_idReclamo
	  and dr.det_estado    = 1
      and dr.det_idSolucionador = p_id_solucionador
      order by r.rec_prioridad asc;
  ELSE 
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT 
    r.rec_idReclamo,
	r.rec_codigoReclamo as codigo,   
    ( SELECT p.pro_descripcion
		                    FROM TB_REC_MAE_Productos P
		                   WHERE p.pro_idProducto = r.rec_idProducto
						     AND P.pro_estado = 1) as pro_descripcion,
	-- p.pro_descripcion,
 (SELECT m.mot_descripcion
		                 FROM TB_REC_MAE_Motivos m
						WHERE m.mot_idMotivo = r.rec_idMotivo
						  AND m.mot_estado = 1) as mot_descripcion,
    -- m.mot_descripcion,
    r.rec_nombre_Cliente,
    r.rec_FechaIngreso,
    r.rec_fechaEstimadaSolucion,
	dr.det_estadoReclamo as rec_EstadoReclamo,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado =1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = dr.det_estadoReclamo
						  and tc.tca_idTipoCatalogo = 1 ) as desEstadoReclamo,
	r.rec_EstadoTiempoBanco,
	rec_formulario,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco 
						  and tc.tca_idTipoCatalogo = 6 )as desEstadoTiempoBanco,
	dr.det_idSolucionador,
	det_estadoReclamo,
	det_estado,
	r.rec_solucionador as rec_usuarioModificacion,
	r.rec_fechaSolucionReclamo,
	r.rec_id_forma_devolucion,
 ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_id_forma_devolucion
						  and tc.tca_idTipoCatalogo = 18 ) as desFormaDevolucion,
(select seg.seg_segmento from rec_p_segmento seg where seg.seg_id_segmento = r.rec_prioridad) as desPrioridad
    from TB_REC_MAE_Reclamos r, 
         TB_REC_DET_detallesReclamos dr
    where dr.det_idReclamo = r.rec_idReclamo
	  and dr.det_estado    = 1
      and dr.det_idSolucionador = p_id_solucionador
	  and dr.det_estadoReclamo = p_id_estado
	  and r.rec_idProducto <> 0
      order by r.rec_prioridad asc;
  END IF;


END ;;
DELIMITER ;
