CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ImagenesAll`(
	p_id_detalle_reclamo int,
	p_opcion             int)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	declare v_idReclamo int;
    set v_idReclamo = (select dr.det_idReclamo from TB_REC_DET_detallesReclamos dr where dr.det_idDetalleReclamo = p_id_detalle_reclamo
limit 1);
	if p_opcion  = 1
	THEN
	    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    	select im.img_idImagen,im.img_imagen,im.img_idDetalleReclamo, im.img_imprimir
		from TB_REC_DET_imagenesDetalles im, TB_REC_DET_detallesReclamos dr
		where im.img_idDetalleReclamo = dr.det_idDetalleReclamo
		  and im.img_estado = 1
		  and dr.det_idReclamo=v_idReclamo
		  --  SQLINES DEMO *** leReclamo = @id_detalle_reclamo
		  and dr.det_estado = 1;
    END IF;

	if p_opcion  = 2 --  SQLINES DEMO *** mprimir sea igual a 1
	THEN
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	select im.img_idImagen,im.img_imagen,im.img_idDetalleReclamo, im.img_imprimir
		 from TB_REC_DET_imagenesDetalles im, TB_REC_DET_detallesReclamos dr
		where im.img_idDetalleReclamo = dr.det_idDetalleReclamo
		  and im.img_estado = 1
		  --  SQLINES DEMO *** leReclamo = @id_detalle_reclamo 
		  and dr.det_idReclamo=v_idReclamo
		  AND im.img_imprimir = 1
		  AND dr.det_estado = 1;
	END IF;

END ;;
DELIMITER ;
