			   i.imo_idReclamo,
			   i.imo_imagen as img_imagen,
			   imo_imprimir
		FROM TB_REC_DET_ImagenesOficial i
		WHERE i.imo_idReclamo = p_id_reclamo
		  AND i.imo_estado = 1
		  AND i.imo_imprimir = 1;
   END IF;
END ;;
