CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ProductosCompuestos`()
BEGIN
DECLARE NOT_FOUND INT DEFAULT FALSE;
DECLARE v_valores VARCHAR(1000);
        DECLARE v_tipo    int DEFAULT null;
DECLARE c_tipo_producto CURSOR FOR   
SELECT   pr.pro_idProducto 
 FROM TB_REC_MAE_Productos pr;
 
DECLARE CONTINUE HANDLER FOR NOT FOUND SET NOT_FOUND = TRUE;
BEGIN

    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    create temporary table temp (
    tipo int,
    cadena varchar(1000)
    );
    OPEN c_tipo_producto;  
    FETCH  c_tipo_producto   
    INTO v_tipo;
      
    WHILE NOT_FOUND = FALSE 
    DO 
    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    set v_valores = null;
       -- SQLINES LICENSE FOR EVALUATION USE ONLY
      
set v_valores =  (SELECT 
    Group_concat(A.pro_descripcion) FROM
    (SELECT pr.pro_descripcion FROM
    TB_REC_DET_ProductoCompuesto p,
    TB_REC_MAE_Productos pr
WHERE
    p.pc_idProducto IS NOT NULL
        AND p.pc_estado = 1
        AND pr.pro_idProducto = p.pc_idProductoCompuesto
        AND pr.pro_compuesto = 0
        AND p.pc_idProducto = v_tipo) as A);
    
      -- select @valores
       insert into temp values(v_tipo,v_valores);
	   FETCH  c_tipo_producto INTO v_tipo;  
    
    END WHILE;
     -- SQLINES DEMO *** emp 
       
SELECT 
    `pro_idProducto`,
    `pro_tipo`,
    `pro_descripcion`,
    t.cadena,
    p.pro_compuesto,
    `pro_tiempoAtencionBanco`,
    `pro_tiempoAtencionSuper`,
    (SELECT 
            tim_descripcion
        FROM
            TB_REC_CAT_TiemposSBE
        WHERE
            tim_idTiempo = p.pro_tiempoAtencionSuper) AS desTiempoSBE,
    `pro_estado`
FROM
    TB_REC_MAE_Productos p,
    temp t
WHERE
    p.pro_idProducto = t.tipo
ORDER BY pro_idProducto;
    
       drop table temp; 
     CLOSE c_tipo_producto;  

END;
END ;;
DELIMITER ;
