CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ProductosSolucionador`()
BEGIN
DECLARE NOT_FOUND INT DEFAULT FALSE;
DECLARE v_valores VARCHAR(1000);
DECLARE v_tipo    int DEFAULT null;
DECLARE v_descripcion varchar(1000);
DECLARE v_idProductoSolucionador bigint DEFAULT null;
DECLARE v_estado_detSol tinyint;

DECLARE c_Solucionador_Producto CURSOR FOR   
SELECT  
distinct pr.ps_idProducto, p.pro_descripcion,pr.ps_estado
FROM TB_REC_DET_productoSolucionadores pr
inner join TB_REC_MAE_Productos p on p.pro_idProducto = pr.ps_idProducto
where pr.ps_estado=1;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET NOT_FOUND = TRUE;
BEGIN

    create temporary table temp (
    tipo int null,
    cadena varchar(1000),
	descripcion varchar(1000),
	estado_detSol tinyint(1)
    );
    OPEN c_Solucionador_Producto; 
    FETCH c_Solucionador_Producto   
    INTO v_tipo, v_descripcion, v_estado_detSol;
      
    WHILE NOT_FOUND = FALSE  
    DO 
    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    set v_valores = null;
       -- SQLINES LICENSE FOR EVALUATION USE ONLY
       set v_valores = 		( select  Group_concat(A.usua_usuario)
								from
								(select ps.ps_idProducto, p.pro_descripcion,ps.ps_idSolucionador, u.usua_usuario
										FROM TB_REC_DET_productoSolucionadores ps
										inner join TB_REC_MAE_Productos p on p.pro_idProducto= ps.ps_idProducto
										inner join TB_REC_MAE_Usuarios u on u.usua_idUsuario = ps.ps_idSolucionador
										and ps.ps_idProducto = v_tipo
										and ps.ps_estado = 1
										) as A);

       insert into temp values(v_tipo,v_valores, v_descripcion,v_estado_detSol);
        FETCH c_Solucionador_Producto INTO v_tipo, v_descripcion,v_estado_detSol;
    
    END WHILE; 
 
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT  
		pc.pro_idProducto as ps_idProducto,
		null as ps_idProductoSolucionador,
		pc.pro_descripcion,
		t.cadena,
		null as ps_idSolucionador,
		t.estado_detSol as ps_estado,
		null as ps_default
	FROM  TB_REC_MAE_Productos pc , temp t
	where pc.pro_idProducto= t.tipo
	order by pc.pro_idProducto;

   
       drop table temp; 
     CLOSE c_Solucionador_Producto;  
END;
END ;;
DELIMITER ;
