CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_Reclamo`()
BEGIN
		SELECT r.rec_idReclamo,
    rec_codigoReclamo as codReclamo,
	-- s.sol_descripcion
	r.rec_idProducto,
    ( SELECT p.pro_descripcion
		                    FROM TB_REC_MAE_Productos P
		                   WHERE p.pro_idProducto = r.rec_idProducto) as pro_descripcion,
	r.rec_idMotivo,
	(SELECT m.mot_descripcion
		                 FROM TB_REC_MAE_Motivos m
						WHERE m.mot_idMotivo = r.rec_idMotivo) as mot_descripcion,
	r.rec_EstadoReclamo,
	( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoReclamo 
						  and tc.tca_idTipoCatalogo = 1 ) as descripcionEstado,
    r.rec_origen,
    -- descripcionOrigen
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_origen
						  and tc.tca_idTipoCatalogo = 3 ) as descripcionOrigen,
    r.rec_numeroOficinaReclamo,
    r.rec_nombreOficinaReclamo,
    r.rec_FechaIngreso,
    r.rec_tipoPersona,
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_tipoPersona
						  and tc.tca_idTipoCatalogo = 5) as desTipoDocumento,
	CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
    r.rec_nombre_Cliente,
    r.rec_nombreOficialCuenta,
    -- detalles reclamo
    r.rec_numeroOficinaOrigenReclamo,
    r.rec_nombreOficinaOrigenReclamo,
   -- r.rec_Monto,
	--  SQLINES DEMO *** dor,
	r.rec_EstadoTiempoBanco,
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco
						  and tc.tca_idTipoCatalogo = 6) as desEstadoTiempoBanco,
	r.rec_EstadoTiempoSBE,
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_EstadoTiempoSBE
						  and tc.tca_idTipoCatalogo = 7) as desEstadoTiempoSBE,
	r.rec_FavorableDesfavorable,
    ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_FavorableDesfavorable
						  and tc.tca_idTipoCatalogo = 4) as desFavorableDesfavorable,
	r.rec_videoconciliacion,
	r.rec_formulario,
	r.rec_fechaModificacion,
    (select s.ser_descripcion from rec_m_servicios s where s.ser_idServicio = r.rec_idServicio) as descServicio,
	( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = r.rec_canal
						  and tc.tca_idTipoCatalogo = 19) as descCanal,
	 r.rec_canal,
     r.rec_solucionador,
     r.rec_fechaCierre
FROM TB_REC_MAE_Reclamos r
order by r.rec_idReclamo desc;
/* SQLINES DEMO ** dbo].[TB_REC_DET_detallesReclamos] dr
 ON dr.det_idReclamo = r.rec_idReclamo 
 INNER JOIN  [dbo].[TB_REC_MAE_Productos] p
 ON P.pro_idProducto = R.rec_idProducto
 INNER JOIN [dbo].[TB_REC_MAE_Motivos] m
 ON m.mot_idMotivo = r.rec_idMotivo 
 LEFT OUTER JOIN [dbo].[TB_REC_CAT_Solucionadores] s
 ON s.sol_idSolucionador = dr.det_idSolucionador*/  

END ;;
