CREATE DEFINER=`root`@`localhost` PROCEDURE `Sp_REC_CON_ReclamosVencidos`(
p_tipo int)
BEGIN

SET TRANSACTION ISOLATION LEVEL READ COMMITTED;

if p_tipo = 1 --  SQLINES DEMO *** tes de vencer tiempoSBE
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select  R.rec_idReclamo,
			 r.rec_codigoReclamo,
			 r.rec_nombre_Cliente,
             CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
             CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
			 r.rec_EstadoReclamo			 				
       from TB_REC_MAE_Reclamos r	
	  where (TIMESTAMPADD(day, -2, r.rec_fechaEstimadaSolucionSBE)) = CONVERT (NOW(3), date)
	  and r.rec_EstadoReclamo <> 4
	  and (r.rec_fechaVencDS is null or rec_fechaVencDS <> CONVERT (NOW(3), date))
	  and IFNULL(r.rec_notifica_VencDS, 0) < (select cat.cat_valor1 from TB_REC_DET_Catalogos cat where cat.cat_idCatalogo = 66);
      
   END IF;

   if p_tipo = 2 --  SQLINES DEMO *** tes de vencer tiempoBanco
   THEN
    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    select   R.rec_idReclamo,
			 r.rec_codigoReclamo,
			 r.rec_nombre_Cliente,
             CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
			 CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
			 r.rec_EstadoReclamo			 			 				
       from TB_REC_MAE_Reclamos r	
	  where (TIMESTAMPADD(day, -2, r.rec_fechaEstimadaSolucion)) = CONVERT (NOW(3), date)
	  and r.rec_EstadoReclamo <> 4
	  and (r.rec_fechaVencDB is null or rec_fechaVencDB <> CONVERT (NOW(3), date))
	  and IFNULL(r.rec_notifica_VencDB, 0) < (select cat.cat_valor1 from TB_REC_DET_Catalogos cat where cat.cat_idCatalogo = 65);      
   END IF;

   if p_tipo = 3 --  SQLINES DEMO *** tes de vencer tiempoSBE
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select  R.rec_idReclamo,
			 r.rec_codigoReclamo,
			 r.rec_nombre_Cliente,
			 CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
			 CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
			 r.rec_EstadoReclamo			 				
       from TB_REC_MAE_Reclamos r	
	  where (TIMESTAMPADD(day, -1, r.rec_fechaEstimadaSolucionSBE)) = CONVERT (NOW(3), date)
	  and r.rec_EstadoReclamo <> 4
	  and (r.rec_fechaVencUS is null or rec_fechaVencUS <> CONVERT (NOW(3), date));
      
   END IF;

   if p_tipo = 4 --  SQLINES DEMO *** tiempoSBE
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select  R.rec_idReclamo,
			 r.rec_codigoReclamo,
			 r.rec_nombre_Cliente,
			 CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
			 CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
			 r.rec_EstadoReclamo			 				
       from TB_REC_MAE_Reclamos r	
	  where r.rec_fechaEstimadaSolucionSBE < CONVERT (NOW(3), date)
	  and r.rec_EstadoReclamo <> 4
	  and (r.rec_fechaVencS is null or rec_fechaVencS <> CONVERT (NOW(3), date))
	  and IFNULL(r.rec_notifica_VencS, 0) < (select cat.cat_valor1 from TB_REC_DET_Catalogos cat where cat.cat_idCatalogo = 68);
      
   END IF;

   if p_tipo = 5 --  SQLINES DEMO *** tiempoBanco
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select  R.rec_idReclamo,
			 r.rec_codigoReclamo,
			 r.rec_nombre_Cliente,
			 CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
			 CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
			 r.rec_EstadoReclamo			 				
       from TB_REC_MAE_Reclamos r	
	  where  r.rec_fechaEstimadaSolucion < CONVERT (NOW(3), date)
	  and r.rec_EstadoReclamo <> 4      
	  and (r.rec_fechaVencB is null or rec_fechaVencB <> CONVERT (NOW(3), date))
	  and IFNULL(r.rec_notifica_VencB, 0) < (select cat.cat_valor1 from TB_REC_DET_Catalogos cat where cat.cat_idCatalogo = 67);
   END IF;

END ;;
