CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ReporteReclamosTiempos`(
 p_id_producto       int  /* = null */,
 p_id_servicio       int  /* = null */,
 p_id_motivo         int  /* = null */,
 p_fecha_ingreso     datetime(3) /* = null */,
 p_id_estadoCaso		int  /* = null */,
 p_id_tipoMotivo		int  /* = null */,
 p_id_origen			int  /* = null */,
 p_id_formaDevol		int  /* = null */,
 p_id_riesgo			int  /* = null */,
 p_fecha_fin     datetime(3) /* = null */)
BEGIN
declare v_condicion varchar(4000);
declare v_query varchar(4000);
declare v_fechaFinal      varchar(30);
declare v_fecha_ingresoM  varchar(30);
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.

	--  SQLINES DEMO ***  = CONVERT(VARCHAR(25),DATEADD(dd,-(DAY(@fecha_ingreso)-1),@fecha_ingreso),103)
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	set v_fecha_ingresoM = date_format(p_fecha_ingreso,'%Y-%m-%d'); 
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	set v_fechaFinal = date_format(p_fecha_fin,'%Y-%m-%d'); 

	if p_id_producto = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_producto = null;
	end if;

	if p_id_motivo = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_motivo = null;
	end if;
	
	if p_id_servicio = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_servicio = null;
	end if;

	if p_id_tipoMotivo = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_tipoMotivo = null;
	end if;

	if p_id_estadoCaso = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_estadoCaso = null;
	end if;

	if p_id_origen = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_origen = null;
	end if;

	if p_id_formaDevol = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_formaDevol = null;
	end if;

	if p_id_riesgo = 0 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	set p_id_riesgo = null;
	end if;
	--  SQLINES DEMO *** TEADD(MINUTE,-1,dateadd(day,1,@fecha_ingreso))

	-- SQLINES LICENSE FOR EVALUATION USE ONLY
 
    

	SELECT
	    rec_idReclamo,
		rec_codigoReclamo as codReclamo,	    
	    r.rec_fechaIngreso,
	    r.rec_origen,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_origen
	    					  and tc.tca_idTipoCatalogo = 3 ) as descripcionOrigen,
	    r.rec_numeroOficinaReclamo,
	    r.rec_nombreOficinaReclamo,
	    r.rec_nombre_Cliente,
		r.rec_tipoPersona,
		/* SQLINES DEMO ***  ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_tipoPersona
	    					  and tc.tca_idTipoCatalogo = 5 ),*/

	    (select pro_tipo 
		              from TB_REC_MAE_Productos p 
					 where p.pro_idProducto = r.rec_idProducto) as pro_tipo,
	    r.rec_Monto,
	    -- r.rec_idProducto,
		--  SQLINES DEMO ***  homologado
        /* SQLINES DEMO *** (select pro_descripcion 
		              from [dbo].[TB_REC_MAE_Productos] p 
					 where p.pro_idProducto = r.rec_idProducto),*/
		
		(select F_REC_CONSULTA_PRODUCTO(r.rec_idProducto)) as pro_descripcion,
	    -- r.rec_idMotivo,
        (select mot_descripcion from TB_REC_MAE_Motivos m where m.mot_idMotivo = r.rec_idMotivo) as mot_descripcion,
	    r.rec_DepartamentoOrigenRecalmo,
	    r.rec_lineaNegocio,
	    r.rec_nombreOficinaOrigenReclamo,
	    r.rec_DetalleReclamo,
	    r.rec_solucionProblema,
	    r.rec_diasUtilizados,
	    r.rec_diasSBE as rec_plazoNormativa,
	    r.rec_FavorableDesfavorable,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_FavorableDesfavorable
	    					  and tc.tca_idTipoCatalogo = 4) as desFavorableDesfavorable,
   	    r.rec_EstadoReclamo,
        ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_EstadoReclamo 
	    					  and tc.tca_idTipoCatalogo = 1 ) as descripcionEstado,
	    --  SQLINES DEMO *** iva,
	    --  SQLINES DEMO *** sProceso,
	    r.rec_accionesAdministrativas,
	    r.rec_ContestacionCliente,
	    r.rec_riesgo,
        -- descripcionOrigen
        ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_riesgo
	    					  and tc.tca_idTipoCatalogo = 2 ) as desRiesgo,       
		CAST(AES_DECRYPT(rec_Correo, 'Pa$$')AS CHAR(100)) as rec_Correo,
        r.rec_EstadoTiempoBanco,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_EstadoTiempoBanco
	    					  and tc.tca_idTipoCatalogo = 6) as desEstadoTiempoBanco,
        
	    r.rec_EstadoTiempoSBE,
	    ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_EstadoTiempoSBE
	    					  and tc.tca_idTipoCatalogo = 7) as desEstadoTiempoSBE,
	    r.rec_diasSBE as pro_tiempoAtencionSuper,		  
        CAST(AES_DECRYPT(rec_codigoOperacion, 'Pa$$')AS CHAR(100)) as valorCtaOperacion,
		CAST(AES_DECRYPT(rec_IdentificacionCliente, 'Pa$$')AS CHAR(100)) as rec_IdentificacionCliente,
		r.rec_fechaVencimiento,
		r.rec_fechaCierre,
		r.rec_usuarioRegistro,
		r.rec_MontoDevolucion,
        r.rec_idServicio,
	 ( select ser_descripcion from rec_m_servicios where ser_idServicio = r.rec_idServicio) as desServicio,
	 ( select ca.cat_descripciÃ³n  
	    					from TB_REC_DET_Catalogos ca, 
	    						 TB_REC_CAT_TiposCatalogos tc
	    					where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	    					  and ca.cat_estado = 1
	    					  and tc.tca_estado = 1
	    					  and ca.cat_idCatalogo = r.rec_id_forma_devolucion
	    					  and tc.tca_idTipoCatalogo = 18 ) as desFormaDevolucion,
		r.rec_solucionador as solucionador,
		r.rec_fechaSolucionReclamo,
        r.rec_fechaEnvioCarta
    FROM TB_REC_MAE_Reclamos r
    where (r.rec_FechaIngreso  between v_fecha_ingresoM and v_fechaFinal)
      and (r.rec_idMotivo = p_id_motivo  or p_id_motivo  is null)
      and (r.rec_idProducto = p_id_producto or p_id_producto is null)
      and (r.rec_idServicio = p_id_servicio or p_id_servicio is null)
	  and (r.rec_EstadoReclamo = p_id_estadoCaso  or p_id_estadoCaso  is null)
	  and (r.rec_idTipoMotivo = p_id_tipoMotivo  or p_id_tipoMotivo  is null)
	  and (r.rec_origen = p_id_origen  or p_id_origen  is null) 
	  and (r.rec_id_forma_devolucion = p_id_formaDevol  or p_id_formaDevol  is null)
	  and (r.rec_riesgo = p_id_riesgo  or p_id_riesgo  is null);
END;
END ;;
