CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ReporteRiesgoOperativo`(
	p_fecha_inicio  varchar(30) /* = null */,
	p_fecha_fin	   varchar(30)  /* = null */)
BEGIN
declare v_fecha varchar(30);
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	set v_fecha = TIMESTAMPADD(MINUTE,-1,timestampadd(day,1,p_fecha_fin));

    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    select r.rec_numeroOficinaReclamo,
	       substring( r.rec_nombreOficinaReclamo,1,20) as rec_nombreOficinaReclamo,
	       substring( r.rec_nombre_Cliente,1,50) as rec_nombre_Cliente,
	       substring( CONVERT( DECRYPTBYPASSPHRASE('Pa$$',rec_IdentificacionCliente), CHAR(100)),1,15) as rec_IdentificacionCliente,
	       (select SUBSTRING( p.pro_tipo,1,10) from TB_REC_MAE_Productos p where p.pro_idProducto = r.rec_idProducto) as tipoProducto,
	       SUBSTRING(CONVERT( DECRYPTBYPASSPHRASE('Pa$$',rec_codigoOperacion), CHAR(100)),1,16) as rc_valor,
	       rec_Monto = REPLACE (r.rec_Monto,'.',''),
	       r.rec_idProducto,
	       r.rec_idMotivo,
	       (select substring(REPLACE(m.mot_descripcion,',',' '),1,255)
								from TB_REC_MAE_Motivos m
							   where m.mot_idMotivo = r.rec_idMotivo
								) as motivoDescripcion,
           date_format(r.rec_FechaIngreso,'%Y%m%d') as rec_FechaIngreso,
		   date_format(r.rec_fechaSolucionReclamo,'%Y%m%d') as rec_fechaSolucionReclamo,
	       r.rec_diasUtilizados,
	       r.rec_plazoNormativa,
	       ( select substring (ca.cat_descripciÃ³n,1,12) as desFavorableDesfavorable
						           from TB_REC_DET_Catalogos ca, 
						           	    TB_REC_CAT_TiposCatalogos tc
						           where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						             and ca.cat_estado = 1
						             and tc.tca_estado = 1
						             and ca.cat_idCatalogo = r.rec_FavorableDesfavorable
						             and tc.tca_idTipoCatalogo = 4),
           ( select substring (ca.cat_descripciÃ³n,1,11)
	       					    from TB_REC_DET_Catalogos ca, 
	       					    	 TB_REC_CAT_TiposCatalogos tc
	       					    where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	       					      and ca.cat_estado = 1
	       					      and tc.tca_estado = 1
	       					      and ca.cat_idCatalogo = r.rec_EstadoReclamo 
	       					      and tc.tca_idTipoCatalogo = 1 ) as descripcionEstado,
	       substring (r.rec_accionesAdministrativas,1,255) as rec_accionesAdministrativas,
	       ( select substring( ca.cat_descripciÃ³n,1,1)
	       				from TB_REC_DET_Catalogos ca, 
	       					 TB_REC_CAT_TiposCatalogos tc
	       				where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
	       				  and ca.cat_estado = 1
	       				  and tc.tca_estado = 1
	       				  and ca.cat_idCatalogo = r.rec_riesgo
	       				  and tc.tca_idTipoCatalogo = 2 ) as desRiesgo
     from TB_REC_MAE_Reclamos r
	where rec_FechaIngreso between p_fecha_inicio and v_fecha;

END;




END ;;
