CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_ReportesByProducto`(
    p_feha_Ingreso datetime(3))
BEGIN

declare v_valor_media int; 

BEGIN

	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
	
    delete from TB_REC_DET_Cumplimientos;
    insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Enero');
	insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Febrero');
	insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Marzo');
	insert TB_REC_DET_Cumplimientos  (cum_mes)
	values ('Abril');
	insert TB_REC_DET_Cumplimientos  (cum_mes)
	values ('Mayo');
	insert TB_REC_DET_Cumplimientos  (cum_mes)
	values ('Junio');
	insert TB_REC_DET_Cumplimientos  (cum_mes)
	values ('Julio');
	insert TB_REC_DET_Cumplimientos  (cum_mes)
    values ('Agosto');
	insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Septiembre');
	insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Octubre');
	insert TB_REC_DET_Cumplimientos (cum_mes)
    values ('Noviembre');
	insert TB_REC_DET_Cumplimientos (cum_mes)
	values ('Diciembre');

	 --  SQLINES DEMO *** o de reclamos
   update TB_REC_DET_Cumplimientos n 
      set cum_numReclamo =  ( select COUNT(cast(r.rec_idReclamo as UNSIGNED)) 
                            FROM TB_REC_MAE_Reclamos r--  SQLINES DEMO *** imientos n
                           WHERE YEAR(rec_FechaIngreso) = year(p_feha_Ingreso)
   				          and n.cum_mes = MONTHNAME(rec_FechaIngreso)
                        GROUP BY MONTHNAME(rec_FechaIngreso)
   				      )
  ;
  
   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   select cat_valor1 into v_valor_media
	  from TB_REC_DET_Catalogos
	  where cat_idTipoCatalogo = 9;
	  
   /* SQLINES DEMO ***  la media de todos los productos
   select sum (p.pro_tiempoAtencionBanco) / count (1) as tim_dias,
	         'Productos'  as tim_descripcion 
	   from TB_REC_MAE_Productos p
    */
	  --  SQLINES DEMO *** amos atendidos a tiempo
   update TB_REC_DET_Cumplimientos n
      set cum_numReclamoAtendido = (SELECT  COUNT (cast(rec_idReclamo as UNSIGNED)) AS totalReclamos
   					                 FROM TB_REC_MAE_Reclamos r
   								    WHERE YEAR(rec_FechaIngreso) = year(p_feha_Ingreso)-- parametro de 
   								 	and n.cum_mes = MONTHNAME(rec_FechaIngreso)
   								    and  TIMESTAMPDIFF ( day , r.rec_FechaIngreso ,r.rec_fechaSolucionReclamo) <= v_valor_media
   								   GROUP BY MONTHNAME(rec_FechaIngreso)
   								   )			
  ;

   --  SQLINES DEMO *** amos no atendidos a tiempo 
    update TB_REC_DET_Cumplimientos n
      set cum_numReclamoNoAtendidoTiempo = (SELECT  COUNT (cast(rec_idReclamo as UNSIGNED)) AS totalReclamos
   					                 FROM TB_REC_MAE_Reclamos r
   								    WHERE YEAR(rec_FechaIngreso) = year(p_feha_Ingreso)-- parametro de 
   								 	and n.cum_mes = MONTHNAME(rec_FechaIngreso)
   								    and  TIMESTAMPDIFF ( day , r.rec_FechaIngreso ,r.rec_fechaSolucionReclamo) > v_valor_media
   								   GROUP BY MONTHNAME(rec_FechaIngreso)
   								   )			
  ;
   
   --  SQLINES DEMO *** ntaje de los reclamos
   update TB_REC_DET_Cumplimientos n
	  --  SQLINES DEMO *** Atendido = cast(round((CONVERT(decimal(4,2), cum_numReclamoAtendido)/CONVERT(decimal(4,2), cum_numReclamo))*100,2) as decimal (5,2)) 
	  set cum_porReclamoAtendido = cast(round((cum_numReclamoAtendido/cum_numReclamo)*100,2) as decimal (5,2)) 
  ;
  
   --  SQLINES DEMO *** res en 0 si estaba en nulo
   update TB_REC_DET_Cumplimientos
      set cum_porReclamoAtendido = 0
   where  cum_porReclamoAtendido is null;   

   --  SQLINES DEMO *** icacion del reclamo
   update TB_REC_DET_Cumplimientos n
      set cum_calificacion = ( select ca.cat_descripciÃ³n  
   						from TB_REC_DET_Catalogos ca, 
   							 TB_REC_CAT_TiposCatalogos tc
   						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
   						  and ca.cat_estado = 1
   						  and tc.tca_estado = 1
   						  and tc.tca_idTipoCatalogo = 8
   						  and n.cum_porReclamoAtendido between  ca.cat_valor1 and  ca.cat_valor2 
   					 ) 
   ;
   
   --  SQLINES DEMO ***  NULL EN CERO
   update TB_REC_DET_Cumplimientos
      set cum_numReclamo = 0
   where  cum_numReclamo is null;  
   
   update TB_REC_DET_Cumplimientos
      set cum_numReclamoAtendido = 0
   where  cum_numReclamoAtendido is null;      

   update TB_REC_DET_Cumplimientos
      set cum_numReclamoNoAtendidoTiempo = 0
   where  cum_numReclamoNoAtendidoTiempo is null;     
   
   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   select n.cum_mes,
          n.cum_numReclamo,
          n.cum_numReclamoAtendido,
		  n.cum_porReclamoAtendido,
		  n.cum_numReclamoNoAtendidoTiempo,
		  n.cum_calificacion        
   from TB_REC_DET_Cumplimientos n;
   
  delete from TB_REC_DET_Cumplimientos;

END;









END ;;
