CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_Reporte_Encuestas`(
p_id_pregunta int /* = null */,
p_id_resolucion int /* = null */,
p_fecha_ingreso     datetime(3) /* = null */,
p_fecha_fin     datetime(3) /* = null */)
BEGIN
declare v_pregunta int;
declare v_resolucion int;

	if p_id_pregunta is null or p_id_pregunta = 0 then
		set v_pregunta = null;
	else
		set v_pregunta = p_id_pregunta;
	end if;

	if p_id_resolucion is null or p_id_resolucion = 0 then
		set v_resolucion = null;
	else
		set v_resolucion = p_id_resolucion;
	end if;

select 
e.enc_fechaRegistro as fecha,
rec.rec_codigoReclamo as codigoReclamo,
rec.rec_nombre_Cliente as Cliente,
p.pre_idPregunta as pre_idPregunta,
p.pre_pregunta as pregunta,
(select c.cat_descripciÃ³n from TB_REC_DET_Catalogos c where rec.rec_FavorableDesfavorable = c.cat_idCatalogo) as resolucion,
e.enc_idRespuesta,
(CASE r.res_tipoRespuesta
   when 94 then e.enc_numero
   when 95 then e.enc_texto
   when 96 then e.enc_idRespuesta
   ELSE NULL
END) as respuesta
from rec_m_encuesta e
INNER JOIN  rec_m_pregunta p ON p.pre_idPregunta = e.pre_idPregunta
AND p.pre_estado='1'
INNER JOIN rec_d_respuesta r ON r.pre_idPregunta = p.pre_idPregunta
AND r.res_estado='1'
INNER JOIN TB_REC_MAE_Reclamos rec where e.rec_idReclamo = rec.rec_idReclamo
	and rec.rec_FavorableDesfavorable = IFNULL(v_resolucion, rec.rec_FavorableDesfavorable)
	 and e.enc_fechaRegistro  between p_fecha_ingreso and p_fecha_fin
      and e.enc_idPregunta = IFNULL(v_pregunta, enc_idPregunta);

END ;;
DELIMITER ;
