CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_Respuestas`(
p_opcion int /* = 0 */,
p_idRespuesta int /* = 0 */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
  	if p_opcion = 1
	THEN
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
        -- Recupera todas las respuestas para preguntas activas
        -- David Barrera :: 2021-09-08 :: Actualizado para traer toda la informacion relacionada
        -- David Barrera :: 2021-09-10 :: Validacion si los campos relacionados son null
		SELECT 
			r.res_idRespuesta,
            r.res_tipoRespuesta AS 'res_idTipoRespuesta',
			c.cat_descripciÃ³n AS 'res_tipoRespuesta',
			r.res_estado,
			r.pre_idPregunta AS 'res_idPregunta',
			p.pre_tipoPregunta AS 'pre_idTipoPregunta',
            c1.cat_descripciÃ³n AS 'pre_tipoPregunta',
			p.pre_pregunta AS 'pre_descripcion',
            IFNULL(pr.pro_idProducto, 0) AS 'pro_idProducto',
			IFNULL(pr.pro_descripcion, 'N/A') AS 'pro_descripcion',
            IFNULL(s.ser_idServicio, 0) AS 'ser_idServicio',
			IFNULL(s.ser_descripcion, 'N/A') AS 'ser_descripcion',
            IFNULL(m.mot_idMotivo, 0) AS 'mot_idMotivo',
			IFNULL(m.mot_descripcion, 'N/A') AS 'mot_descripcion'
		FROM rec_d_respuesta AS r
		JOIN rec_m_pregunta AS p ON p.pre_idPregunta = r.pre_idPregunta
        LEFT JOIN TB_REC_DET_Catalogos AS c ON r.res_tipoRespuesta = c.cat_idCatalogo
        LEFT JOIN TB_REC_DET_Catalogos AS c1 ON p.pre_tipoPregunta = c1.cat_idCatalogo
		LEFT JOIN TB_REC_MAE_productos AS pr ON p.pre_idProducto = pr.pro_idProducto
		LEFT JOIN REC_M_SERVICIOS AS s ON p.pre_idServicio = s.ser_idServicio -- AND pr.pro_idProducto = s.pro_idProducto
		LEFT JOIN TB_REC_MAE_motivos AS m ON p.pre_idMotivo = m.mot_idMotivo -- AND pr.pro_idProducto = m.mot_idProducto
		WHERE p.pre_estado = '1';
	END IF;
	if p_opcion = 2
	THEN
		
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
        -- Recupera una respuesta especificada por p_idRespuesta
		SELECT 
			r.res_idRespuesta,
            r.res_tipoRespuesta AS 'res_idTipoRespuesta',
			c.cat_descripciÃ³n AS 'res_tipoRespuesta',
			r.res_estado,
			r.pre_idPregunta AS 'res_idPregunta',
			p.pre_tipoPregunta AS 'pre_idTipoPregunta',
            c1.cat_descripciÃ³n AS 'pre_tipoPregunta',
			p.pre_pregunta AS 'pre_descripcion',
			pr.pro_descripcion,
			s.ser_descripcion,
			m.mot_descripcion,
            r.res_seleccion1,
            r.res_seleccion2,
            r.res_seleccion3,
            r.res_seleccion4
		FROM rec_d_respuesta AS r
		JOIN rec_m_pregunta AS p ON p.pre_idPregunta = r.pre_idPregunta
        LEFT JOIN TB_REC_DET_Catalogos AS c ON r.res_tipoRespuesta = c.cat_idCatalogo
        LEFT JOIN TB_REC_DET_Catalogos AS c1 ON p.pre_tipoPregunta = c1.cat_idCatalogo
		LEFT JOIN TB_REC_MAE_productos AS pr ON p.pre_idProducto = pr.pro_idProducto
		LEFT JOIN REC_M_SERVICIOS AS s ON p.pre_idServicio = s.ser_idServicio AND pr.pro_idProducto = s.pro_idProducto
		LEFT JOIN TB_REC_MAE_motivos AS m ON p.pre_idMotivo = m.mot_idMotivo AND pr.pro_idProducto = m.mot_idProducto
		WHERE p.pre_estado = '1'
			AND r.res_idRespuesta = p_idRespuesta;
	END IF;

	if p_opcion = 3
	THEN
		-- Recupera preguntas y respuestas activas, asociativamente (no lo usa CRUD)
		select c.enc_idRespuesta,
			   t.enc_idPregunta,
			   t.enc_descripcion desPregunta,
			   c.enc_descripcion,
			   c.enc_estado   
		from  TB_REC_ENC_Respuestas c, TB_REC_ENC_Preguntas t 
		 where t.enc_idPregunta = c.enc_idPregunta
		 and t.enc_estado = '1' 
		 and c.enc_estado = '1';
	END IF;

END ;;
