CREATE DEFINER=`root`@`%` PROCEDURE `SP_REC_CON_Servicio`(
	p_opcion 		int,	/* 0 = todos los servicios, 1 = buscar por id */
    p_idServicio 	int		/* ID del servicio a buscar */
)
BEGIN
-- David Barrera :: 24/09/2021 :: Consulta de Servicios
	IF p_opcion = 0 THEN
		SELECT 
			s.ser_idServicio,
			s.ser_descripcion,
			s.pro_idProducto,
			p.pro_descripcion,
			s.ser_estado,
            IFNULL(s.ser_usuarioRegistro, 'N/A') AS 'ser_usuarioRegistro',
            IFNULL(s.ser_ipRegistro, '0.0.0.0') AS 'ser_ipRegistro',
            IFNULL(s.ser_fechaRegistro, NOW(3)) AS 'ser_fechaRegistro',
            IFNULL(s.ser_usuarioModificacion, 'N/A') AS 'ser_usuarioModificacion',
            IFNULL(s.ser_ipModificacion, '0.0.0.0') AS 'ser_ipModificacion',
            IFNULL(s.ser_fechaModificacion, NOW(3)) AS 'ser_fechaModificacion'
		FROM rec_m_servicios AS s
		JOIN tb_rec_mae_productos AS p ON s.pro_idProducto = p.pro_idProducto;
    ELSEIF p_opcion = 1 THEN
		SELECT 
			s.ser_idServicio,
			s.ser_descripcion,
			s.pro_idProducto,
			p.pro_descripcion,
			s.ser_estado,
            IFNULL(s.ser_usuarioRegistro, 'N/A') AS 'ser_usuarioRegistro',
            IFNULL(s.ser_ipRegistro, '0.0.0.0') AS 'ser_ipRegistro',
            IFNULL(s.ser_fechaRegistro, NOW(3)) AS 'ser_fechaRegistro',
            IFNULL(s.ser_usuarioModificacion, 'N/A') AS 'ser_usuarioModificacion',
            IFNULL(s.ser_ipModificacion, '0.0.0.0') AS 'ser_ipModificacion',
            IFNULL(s.ser_fechaModificacion, NOW(3)) AS 'ser_fechaModificacion'
		FROM rec_m_servicios AS s
		JOIN tb_rec_mae_productos AS p ON s.pro_idProducto = p.pro_idProducto
        WHERE ser_idServicio = p_idServicio;
    END IF;
END ;;
DELIMITER ;
