begin
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	select `rec_idReclamo`,`rec_codigoReclamo` codReclamo,`rec_idProducto`,`rec_idMotivo`
      ,`rec_FechaIngreso`,`rec_codigoOperacion`,`rec_fechaEstimadaSolucion`,''desTipoDocumento
