	  ,`rec_nombre_Cliente`,`rec_codigoOficialCuenta`,`rec_nombreOficialCuenta`,`rec_Telefono1`,`rec_Telefono2`
	  ,`rec_TelefonoOficial`,`rec_direccion`,`rec_provincia`,`rec_Ciudad`,`rec_CiudadOficial`,`rec_lineaNegocio`
      ,`rec_numeroOficinaReclamo`,`rec_nombreOficinaReclamo`,`rec_CiudadOficinaReclamo`,`rec_Monto`
	  ,`rec_Correo`,`rec_numeroOficinaOrigenReclamo`,`rec_nombreOficinaOrigenReclamo`,`rec_DetalleReclamo`
	  ,`rec_peticiÃ³nConcreta`,`rec_formulario`,`rec_accionOperativa`,`rec_EstadoReclamo`,`rec_EstadoTiempoBanco`
	  ,`rec_TiempoAtencionBanco`,`rec_diasSBE`,`rec_EstadoTiempoSBE`,`rec_TiempoAtencionSBE`
      ,`rec_FavorableDesfavorable`,''descripcionFavDes,`rec_accionesAdministrativas`,`rec_EstadoMejorasProceso`,`rec_solucionProblema`
      ,`rec_ContestacionCliente`,`rec_riesgo`,''descripcionRiesgo,`rec_fechaSolucionReclamo`,`rec_diasUtilizados`,`rec_plazoNormativa`
      ,`rec_DepartamentoOrigenRecalmo`,`rec_notificar`,`rec_usuarioRegistro`,`rec_ipRegistro`,`rec_fechaRegistro`
	  ,`rec_usuarioModificacion`,`rec_ipModificacion`,`rec_fechaModificacion`,`rec_fechaVencDB`,`rec_fechaVencDS`
      ,`rec_fechaVencUS`,`rec_fechaVencB`,`rec_fechaVencS`,`rec_IdentificacionApoderado`,`rec_NombreApoderado`
      ,`rec_ApellidoeApoderado`,`rec_ReclamoColectivo`,`rec_videoconciliacion`,`rec_estaAgrupado`,rec_tipoAgrupacion
	  ,rec_fechaEstimadaSolucion,rec_fechaEstimadaSolucionSBE 
	  from TB_REC_MAE_Reclamos rec
	where rec.rec_ReclamoColectivo=p_idReclamo;
end ;;
