CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_SolucionadorByReclamo`( 
	p_idReclamo int)
BEGIN


	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT dr.det_idDetalleReclamo,
	       dr.det_idReclamo,
	       dr.det_idSolucionador,
		   (SELECT s.urol_usuario
	                             FROM  TB_REC_DET_UserRol s
	                            WHERE s.urol_estado       = 1
								  AND s.urol_idUserRol = dr.det_idSolucionador) as desSolucionador,
	      dr.det_estadoReclamo as det_estado,
		  ( select ca.cat_descripciÃ³n  
						from TB_REC_DET_Catalogos ca, 
							 TB_REC_CAT_TiposCatalogos tc
						where ca.cat_idTipoCatalogo = tc.tca_idTipoCatalogo
						  and ca.cat_estado = 1
						  and tc.tca_estado = 1
						  and ca.cat_idCatalogo = dr.det_estadoReclamo 
						  and tc.tca_idTipoCatalogo = 1 ) as descripcionEstado
	  FROM TB_REC_DET_detallesReclamos dr
	 WHERE dr.det_idReclamo = p_idReclamo
	   AND dr.det_estado    = 1;
    
END ;;
DELIMITER ;
