CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_Solucionadores`(
   p_opcion      int  /* = null */,
   p_id_reclamo  int /* = null */,
   p_id_producto int /* = null */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.

   IF p_opcion = 1
   THEN	
	  	
      -- SQLINES LICENSE FOR EVALUATION USE ONLY
      SELECT ps_idSolucionador as idSolucionador,
      (SELECT s.urol_usuario
	                             FROM  TB_REC_DET_UserRol s
	                            WHERE s.urol_estado       = 1
								  AND s.urol_idUserRol = ps.ps_idSolucionador) as desSolucionador
	         /*(SELECT sol_descripcion
	                             FROM TB_REC_CAT_Solucionadores s
	                            WHERE s.sol_estado         = 1
								  AND s.sol_idSolucionador = ps.ps_idSolucionador) as desSolucionador*/
		    ,ps.ps_default
      FROM TB_REC_DET_productoSolucionadores ps
      WHERE ps_idProducto = p_id_producto
	    AND ps_estado = 1
	    AND ps.ps_idSolucionador not in (SELECT dr.det_idSolucionador
		                                   FROM TB_REC_DET_detallesReclamos dr
										  WHERE dr.det_idReclamo = p_id_reclamo
										   -- SQLINES DEMO *** cionador = 1--ps.ps_idSolucionador
										  );
 
    END IF;

	IF p_opcion = 2--  SQLINES DEMO *** LUCIONADORES	QUE TIENE DETALLE
	THEN
      -- SQLINES LICENSE FOR EVALUATION USE ONLY
      SELECT dr.det_idSolucionador as idSolucionador,
	         (SELECT s.urol_usuario
	                             FROM  TB_REC_DET_UserRol s
	                            WHERE s.urol_estado       = 1
								  AND s.urol_idUserRol = dr.det_idSolucionador) as desSolucionador ,
			 dr.det_idReclamo as ps_default  
	    FROM TB_REC_DET_detallesReclamos dr
	   WHERE dr.det_idReclamo = p_id_reclamo
	     AND dr.det_estado    = 1;

	END IF;

	IF p_opcion = 3  -- SQLINES DEMO *** IONADORES PENDIENTE DE SOLUCION y reasignado
	THEN
      --  SQLINES DEMO *** al menos un detalle del reclamo cerrado por el solucionador
	if not exists (SELECT dr.*
					FROM TB_REC_DET_detallesReclamos dr
				   WHERE dr.det_idReclamo = p_id_reclamo
					 AND dr.det_estadoReclamo = 3
					 AND dr.det_estado    = 1) then

      -- SQLINES LICENSE FOR EVALUATION USE ONLY
      SELECT dr.det_idSolucionador as idSolucionador,
	         ( SELECT s.urol_usuario
	                             FROM  TB_REC_DET_UserRol s
	                            WHERE s.urol_estado       = 1
								  AND s.urol_idUserRol = dr.det_idSolucionador
			                    ) as desSolucionador ,
			 dr.det_idReclamo as ps_default, dr.* 
	    FROM TB_REC_DET_detallesReclamos dr
	   WHERE dr.det_idReclamo = p_id_reclamo
	     AND dr.det_estadoReclamo in( 2,6)
		 AND dr.det_estado    = 1;
	end if;

	END IF;



END ;;
DELIMITER ;
