CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_TipoCatalogoOpcion`(
	p_tipoCatalogo    bigint /* = null */,
	p_opcion          int /* = null */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
   
   if p_opcion = 1 
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select c.cat_idCatalogo,
            c.cat_descripciÃ³n
       from TB_REC_CAT_TiposCatalogos t ,TB_REC_DET_Catalogos c
      where t.tca_idTipoCatalogo = c.cat_idTipoCatalogo
        and c.cat_idCatalogo > 0
		 and c.cat_idCatalogo in (1,2,3,4)
        and t.tca_idTipoCatalogo = p_tipoCatalogo
        and t.tca_estado = '1'
        and c.cat_estado = '1';
   END IF;

   if p_opcion = 2 
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select t.tca_idTipoCatalogo,
	        t.tca_descripcion,
			t.tca_estado
       from TB_REC_CAT_TiposCatalogos t; 
   
   END IF;

   if p_opcion = 3 
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select t.tca_idTipoCatalogo,
	        t.tca_descripcion,
			t.tca_estado
       from TB_REC_CAT_TiposCatalogos t 
	  where t.tca_estado = '1';  
   END IF;

   if p_opcion = 4 
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select t.tca_idTipoCatalogo,
	        t.tca_descripcion,
			t.tca_estado
       from TB_REC_CAT_TiposCatalogos t 
	  where t.tca_estado = '1' 
	    AND t.tca_idTipoCatalogo = p_tipoCatalogo; 
   END IF;

   if p_opcion = 5 -- SQLINES DEMO *** ionador
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select c.cat_idCatalogo,
            c.cat_descripciÃ³n
       from TB_REC_CAT_TiposCatalogos t ,TB_REC_DET_Catalogos c
      where t.tca_idTipoCatalogo = c.cat_idTipoCatalogo
        and c.cat_idCatalogo > 0
		 and c.cat_idCatalogo in (2,3,5,6)
        and t.tca_estado = '1'
        and c.cat_estado = '1';
   END IF;

    if p_opcion = 6 -- Bandeja del Oficial
   THEN
     -- SQLINES LICENSE FOR EVALUATION USE ONLY
     select c.cat_idCatalogo,
            c.cat_descripciÃ³n
       from TB_REC_CAT_TiposCatalogos t ,TB_REC_DET_Catalogos c
      where t.tca_idTipoCatalogo = c.cat_idTipoCatalogo
        and c.cat_idCatalogo > 0
		 and c.cat_idCatalogo in (1,2,3,4)
        and t.tca_estado = '1'
        and c.cat_estado = '1'; 
   END IF;

END ;;
