CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_CON_TiposCumplimientos`(
   p_id_tipo int)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	-- Tipo nacional 
	if p_id_tipo = 1 then
	  -- SQLINES LICENSE FOR EVALUATION USE ONLY
  	select t.tim_dias, 
	         t.tim_descripcion
	   from TB_REC_CAT_TiemposSBE t
	  where t.tim_idTiempo = 1;
	end if;

	-- tipo Internacional
	if p_id_tipo = 2 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	select t.tim_dias, 
	         t.tim_descripcion
	   from TB_REC_CAT_TiemposSBE t
	  where t.tim_idTiempo = 2;
	end if;
	-- Tipo Banco media
	if p_id_tipo = 3 then
	   -- SQLINES LICENSE FOR EVALUATION USE ONLY
   	select cat_valor1 as tim_dias,
	          'Bancos' as tim_descripcion
	     from TB_REC_DET_Catalogos
	    where cat_idTipoCatalogo = 9;
	end if;
	 /* SQLINES DEMO *** .pro_tiempoAtencionBanco) / count (1) as tim_dias,
	         'Productos'  as tim_descripcion 
	   from TB_REC_MAE_Productos p
    */
END ;;
