CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_ELI_ImagenesOficial`(
	p_id_reclamo int /* = null */,
	p_id_imagen  int /* = null */,
    p_borra_arc_rec int)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.

	DELETE FROM TB_REC_DET_ImagenesOficial 
	WHERE imo_idIimagenOficial = p_id_imagen
	  AND imo_idReclamo        = p_id_reclamo;
      
      IF(p_borra_arc_rec = 1) THEN
		UPDATE TB_REC_MAE_Reclamos 
		SET	rec_carta = "",
		rec_fechaRegistro = sysdate()
		WHERE rec_idReclamo = p_id_reclamo;
      END IF;
      

END ;;
