CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_ING_Encuesta_New`(
  --  SQLINES DEMO *** int,
  --  SQLINES DEMO *** nt,
  -- @enc_dudas bigint,
  -- @enc_solucion bigint
  p_pxi_encuesta longtext)
BEGIN
   declare cnt int;
  declare ptr int;
  declare rowPtr varchar(100);
  /* insert into TB_REC_ENC_Cliente_Web
 
   SELECT Encuesta.Cliente.value('id_reclamo[1]','INT') AS enc_idReclamo,
            Encuesta.Cliente.value('id_pregunta[1]','INT') AS enc_idPregunta,
			Encuesta.Cliente.value('id_respuesta[1]','INT') AS enc_idRespuesta,
			 NOW(3)
    FROM @pxi_encuesta.nodes;('Encuesta/Cliente') Encuesta(Cliente);*/
    
set cnt = (extractValue(p_pxi_encuesta, 'count(/Encuesta/Cliente)'));
set ptr = 0;
while ptr < cnt do
    SET ptr = ptr + 1;
    SET rowPtr = concat('/Encuesta/Cliente[', ptr, ']');
    INSERT INTO TB_REC_ENC_Cliente_Web (enc_idReclamo,enc_idPregunta, enc_idRespuesta)
    values (extractValue(p_pxi_encuesta, concat(rowPtr, '/id_reclamo')),
            extractValue(p_pxi_encuesta, concat(rowPtr, '/id_pregunta')),
            extractValue(p_pxi_encuesta, concat(rowPtr, '/id_respuesta')));

end while;
SELECT ptr;

END ;;
DELIMITER ;
