CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_ING_ReclamoColectivo`(
  -- @id_reclamo BIGINT,
  --  SQLINES DEMO *** rchar(50),
  p_lista longtext,
  p_opcion int,
  p_usuario varchar(50))
BEGIN
  declare v_ticket varchar(50) default '';
          declare v_anio int;
          declare v_cont int;
          declare v_fechaact datetime(3);
          declare v_codigoshijos varchar(200) default '';
          declare v_tiemposbe int;
          declare v_tiempobanco int;
          declare v_cliente  varchar(50);
          declare v_identificacion varchar(13);
          declare v_tipoPersona int;
          declare v_correo varchar(50);
          declare v_nombreOficial varchar(50);
          declare v_codigoOficial varchar(50);
          declare v_direccion varchar(200);
          declare v_provincia varchar(30);
          declare v_ciudad varchar(30);
          declare v_lineaNegocio varchar(50);
          declare v_numeroOficinaReclamo int;
          declare v_nombreOficinaReclamo varchar(50);
          declare v_ciudadOficinaReclamo varchar(50);
          declare v_idmotivo BIGINT;
          declare v_idProducto bigint;
          DECLARE v_id_reclamo BIGINT;
          declare cnt int;
          declare ptr int;
          declare rowPtr varchar(100);
  BEGIN
    set v_anio = (select YEAR(NOW(3))); 
    set v_ticket = CONCAT('BM-OR-',convert(v_anio, char(4)),'-');
    --  SQLINES DEMO *** mos colectivos
    DROP TEMPORARY TABLE IF EXISTS ReclamosColectivos;
    CREATE TEMPORARY TABLE ReclamosColectivos (id_reclamo int, codigo_reclamo varchar(50));
    
    set cnt = (extractValue(p_lista, 'count(/Colectivos/Reclamo)'));
    set ptr = 0;
    while ptr < cnt do
    
    SET ptr = ptr + 1;
    SET rowPtr = concat('/Colectivos/Reclamo[', ptr, ']');
    INSERT INTO TB_REC_ENC_Cliente_Web (id_reclamo, codigo_reclamo)
    values (extractValue(p_lista, concat(rowPtr, '/id_reclamo')),
            extractValue(p_lista, concat(rowPtr, '/codigo_reclamo')));
    end while;
    SELECT ptr;
    
    set v_fechaact =  (SELECT STR_TO_DATE(NOW(3), 103));
    
	set v_tiemposbe = (select rec_EstadoTiempoSBE from TB_REC_MAE_Reclamos where rec_idReclamo 
    in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo) order by rec_EstadoTiempoSBE asc limit 1);
    
	set v_tiempobanco = (select rec_EstadoTiempoBanco from TB_REC_MAE_Reclamos where rec_idReclamo 
    in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo) order by rec_EstadoTiempoBanco asc  limit 1);
	
	select v_codigoshijos + codigo_reclamo , ' ' into v_codigoshijos from ReclamosColectivos;
    if(p_opcion=1)-- por nombre--
    THEN
      
		set v_cliente = (select rec_nombre_Cliente from TB_REC_MAE_Reclamos  where rec_idReclamo 
               in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo) order by rec_nombre_Cliente asc limit 1);
               
		set v_identificacion = (select CONVERT( DECRYPTBYPASSPHRASE('Pa$$',rec_IdentificacionCliente), CHAR(100)) from TB_REC_MAE_Reclamos 
								where rec_idReclamo in (SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_IdentificacionCliente asc limit 1);
		set v_tipoPersona = (select rec_tipoPersona from TB_REC_MAE_Reclamos 
							where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_tipoPersona asc limit 1);
                            
		set v_correo = (select CONVERT( DECRYPTBYPASSPHRASE('Pa$$',rec_Correo), CHAR(100)) from TB_REC_MAE_Reclamos 
						where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_Correo asc limit 1);
                        
		set v_nombreOficial = (select rec_nombreOficialCuenta from TB_REC_MAE_Reclamos 
								where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_nombreOficialCuenta asc limit 1);
                                
		set v_codigoOficial = (select rec_codigoOficialCuenta from TB_REC_MAE_Reclamos 
								where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_codigoOficialCuenta limit 1);
		set v_direccion = (select rec_direccion from TB_REC_MAE_Reclamos 
									where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_direccion limit 1);
                                    
		set v_provincia = (select rec_provincia from TB_REC_MAE_Reclamos 
									where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_provincia limit 1);
                                    
		set v_ciudad = (select rec_Ciudad from TB_REC_MAE_Reclamos 
									where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_Ciudad limit 1);
                                    
		set v_lineaNegocio = (select rec_lineaNegocio from TB_REC_MAE_Reclamos 
									where rec_idReclamo in(SELECT * from(select id_reclamo from ReclamosColectivos order by id_reclamo LIMIT 1)as id_reclamo)order by rec_lineaNegocio limit 1);
                                    
