	p_rec_canal bigint /* = 0 */,
    p_rec_idServicio bigint,
    p_rec_segmento varchar(3))
sp_lbl:

BEGIN
DECLARE prioridad int;
DECLARE diasSuper int; 
DECLARE diasMax int;
 
	 -- tomar la prioridad
	SELECT c.cat_valor1 INTO prioridad 
FROM rec_p_segmento s, tb_rec_det_catalogos c
WHERE s.seg_codigo = SUBSTR(p_rec_segmento, 1, 1)
  AND s.seg_id_prioridad = c.cat_idCatalogo;
 
SELECT m.mot_DiasSuper, m.mot_DiasMaximo
INTO diasSuper , diasMax 
FROM tb_rec_mae_motivos m
WHERE m.mot_idMotivo = p_rec_idMotivo;

INSERT INTO TB_REC_MAE_Reclamos (
	rec_idProducto, rec_idMotivo, rec_FechaIngreso, rec_codigoOperacion, rec_fechaEstimadaSolucion, rec_fechaEstimadaSolucionSBE, rec_origen,
