	rec_canal, rec_fechaVencimiento, rec_idServicio, rec_segmento, rec_prioridad
) VALUES (
	p_rec_idProducto, p_rec_idMotivo, NOW(3), AES_ENCRYPT(p_rec_codigoOperacion, 'Pa$$'), DATE_ADD(NOW(3), interval diasMax day), DATE_ADD(NOW(3), interval diasSuper day), p_rec_origen,
	p_rec_tipoPersona, AES_ENCRYPT(p_rec_IdentificaciÃ³nCliente, 'Pa$$'), p_rec_nombre_Cliente, p_rec_codigoOficialCuenta, p_rec_nombreOficialCuenta, p_rec_Telefono1,
	p_rec_Telefono2, p_rec_TelefonoOficial, p_rec_direccion, p_rec_provincia, p_rec_Ciudad, p_rec_numeroOficinaReclamo, p_rec_nombreOficinaReclamo,
	p_rec_CiudadOficinaReclamo, p_rec_Monto, AES_ENCRYPT(p_rec_Correo, 'Pa$$'), p_rec_numeroOficinaOrigenReclamo, p_rec_nombreOficinaOrigenReclamo, p_rec_DetalleReclamo,
	p_rec_peticiÃ³nConcreta, p_rec_EstadoReclamo, p_rec_EstadoTiempoBanco, diasMax, p_rec_EstadoTiempoSBE, diasSuper,
	diasSuper, p_rec_notificar, p_rec_diasUtilizados, diasSuper, p_rec_DepartamentoOrigenRecalmo, p_rec_usuarioRegistro,
	p_rec_ipRegistro, NOW(3), p_rec_IdentificacionApoderado, p_rec_NombreApoderado, p_rec_ApellidoApoderado, p_rec_defensor,
	p_rec_canal, DATE_ADD(NOW(3), interval diasMax day), p_rec_idServicio, p_rec_segmento, IFNULL(prioridad, 3)
);

SET p_rec_idreclamo = Last_insert_id();

LEAVE sp_lbl;
 
END ;;
