	   THEN
	     INSERT INTO TB_REC_DET_RolMenu(
	               mrol_idMenu,
	               mrol_idRol,
			       mrol_usuarioCreacion,
	               mrol_fechaCreacion,
	               mrol_estado)
				VALUES(
				   v_idPadre,
				   p_idRol,
				   p_usuarioCreacion,
				   NOW(3),
				   1);
		END IF; 
	END IF;


    INSERT INTO TB_REC_DET_RolMenu(
	        mrol_idMenu,
	        mrol_idRol,
            mrol_edicion,
            mrol_creacion,
            mrol_eliminacion,
            mrol_imprimir,
            mrol_guardar,
			mrol_usuarioCreacion,
	        mrol_fechaCreacion,
	        mrol_estado
	       )
	 VALUES(
	       p_idMenu,
		   p_idRol,
           p_edita,
           p_creacion,
           p_elimininacion,
           p_imprimir,
           p_guardar,
		   p_usuarioCreacion,
		   NOW(3),
		   1);
END ;;
