CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_DetReclamoSolucionadorDevuelto`(
	p_id_solucionador int /* = null */,
	p_id_reclamo int /* = null */,
	p_rec_usuarioModificacion varchar(50) /* = null */,
	p_rec_ipModificacion		 varchar(15) /* = null */)
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
	/* SQLINES DEMO *** C_MAE_Reclamos 
	   set rec_EstadoReclamo    = 5,
	       rec_usuarioModificacion = @rec_usuarioModificacion,
		   rec_ipModificacion	   = @rec_ipModificacion,
		   rec_fechaModificacion   = getdate()
	where rec_idReclamo = ( select dr.det_idReclamo 
							  from dbo.TB_REC_MAE_Reclamos r, 
								   dbo.TB_REC_DET_detallesReclamos dr
							  where r.rec_idReclamo = dr.det_idReclamo
							  and dr.det_idSolucionador = @id_solucionador
							   and dr.det_idReclamo = @id_reclamo)*/
   UPDATE TB_REC_DET_detallesReclamos
       SET det_estado              = 0,--  SQLINES DEMO *** ELTO 
	       det_fechaModificacion   = NOW(3),
	       det_usuarioModificacion = p_rec_usuarioModificacion,
	       det_ipModificacion      = p_rec_ipModificacion
     WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado         = 1;
	   --  SQLINES DEMO *** amo  = 5

   CALL /*@return_value    =*/ `SP_REC_ING_DetalleReclamo`
		 (v_id_reclamo      = p_id_reclamo,
		 p_id_solucionador = p_id_solucionador,
		 p_id_estado       = 5,
		 p_usuarioRegistro = p_rec_usuarioModificacion,
		 p_ipRegistro      = p_rec_ipModificacion);

   
	   --  SQLINES DEMO ***      = 1
    

	if not exists (SELECT 1 FROM TB_REC_DET_detallesReclamos dr
	                 WHERE dr.det_idReclamo = p_id_reclamo
	                   AND dr.det_estadoReclamo    = 2 or DR.det_estadoReclamo = 6
					   AND dr.det_estado = 1
				    )--  SQLINES DEMO *** TADO EN PENDIENTE DE SOLUCION O REASIGNADO
	THEN 
	    UPDATE TB_REC_MAE_Reclamos
		   SET rec_EstadoReclamo       = 3,--  SQLINES DEMO *** L ESTADO DEL RECLAMO
		       rec_fechaModificacion   = NOW(3),
			   rec_usuarioModificacion = p_rec_usuarioModificacion,
			   rec_ipModificacion      = p_rec_ipModificacion
		 WHERE rec_idReclamo = p_id_reclamo;
	ELSE
	     UPDATE TB_REC_MAE_Reclamos
		   SET rec_EstadoReclamo       = 2,--  SQLINES DEMO *** ION PARA EL RECLAMO
		       rec_fechaModificacion   = NOW(3),
			   rec_usuarioModificacion = p_rec_usuarioModificacion,
			   rec_ipModificacion      = p_rec_ipModificacion
		 WHERE rec_idReclamo = p_id_reclamo;
	END IF;

end ;;
