CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_ESTADOSRECLAMOSAGRUPADOS`( p_idReclamoPadre int, p_idEstado int)
begin
	declare v_esPadre int;  
    SET v_esPadre = (select count(r.rec_idReclamo) from TB_REC_MAE_Reclamos r where r.rec_ReclamoColectivo = p_idReclamoPadre);
	if(v_esPadre > 0)
	then
		update TB_REC_MAE_Reclamos set
		rec_EstadoReclamo = p_idEstado
		where rec_ReclamoColectivo = p_idReclamoPadre;
	end if;
end ;;
