CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_FechaNotificaciones`(
    p_rec_idReclamo bigint,
	p_tipo int)
BEGIN   
  
	if p_tipo = 1 --  SQLINES DEMO *** tes de vencer tiempoSBE
		THEN
			UPDATE TB_REC_MAE_Reclamos
			SET rec_fechaVencDS  = CONVERT (NOW(3), date), rec_notifica_VencDS =  IFNULL(rec_notifica_VencDS, 0)+1	         
			WHERE rec_idReclamo  = p_rec_idReclamo;
		END IF;

	if p_tipo = 2 --  SQLINES DEMO *** tes de vencer tiempoBanco
		THEN
			UPDATE TB_REC_MAE_Reclamos
			SET rec_fechaVencDB  = CONVERT (NOW(3), date), rec_notifica_VencDB =  IFNULL(rec_notifica_VencDB, 0)+1 	         
			WHERE rec_idReclamo  = p_rec_idReclamo;
		END IF;

	if p_tipo = 3 --  SQLINES DEMO *** tes de vencer tiempoSBE
		THEN
			UPDATE TB_REC_MAE_Reclamos
			SET rec_fechaVencUS  = CONVERT (NOW(3), date)	         
			WHERE rec_idReclamo  = p_rec_idReclamo;
		END IF;

	if p_tipo = 4 --  SQLINES DEMO *** tiempoSBE
		THEN
			UPDATE TB_REC_MAE_Reclamos
			SET rec_fechaVencS   = CONVERT (NOW(3), date), rec_notifica_VencS =  IFNULL(rec_notifica_VencS, 0)+1         
			WHERE rec_idReclamo  = p_rec_idReclamo;
		END IF;

	if p_tipo = 5 --  SQLINES DEMO *** tiempoBanco
		THEN
			UPDATE TB_REC_MAE_Reclamos
			SET rec_fechaVencB   = CONVERT (NOW(3), date), rec_notifica_VencB =  IFNULL(rec_notifica_VencB, 0)+1   	         
			WHERE rec_idReclamo  = p_rec_idReclamo;
		END IF;

END ;;
