CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_ImagenDetReclamoSolucionador`(
	p_id_solucionador int,
	p_id_reclamo int,
	p_solucion_problema longtext /* = null */,
	p_rec_usuarioModificacion varchar(50) /* = null */,
	p_rec_ipModificacion		 varchar(15) /* = null */)
BEGIN
DECLARE v_id_detalle_reclamo INT;
 DECLARE v_id_detalle_reclamo_actual INT;
 DECLARE v_analisisArea   longtext ;
 DECLARE v_desSolucionador   varchar(100);       
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT dr.det_idDetalleReclamo INTO v_id_detalle_reclamo 
	  FROM TB_REC_DET_detallesReclamos dr
	 WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;
	    
	  UPDATE TB_REC_DET_detallesReclamos
       SET det_estado = 0,
	       det_fechaModificacion = NOW(3),
	       det_usuarioModificacion = p_rec_usuarioModificacion,
	       det_ipModificacion  = p_rec_ipModificacion
     WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;

	 CALL /*@return_value    =*/`SP_REC_ING_DetalleReclamo`
		 (v_id_reclamo      = p_id_reclamo,
		 p_id_solucionador = p_id_solucionador,
		 p_id_estado       = 3,
		 p_usuarioRegistro = p_rec_usuarioModificacion,
		 p_ipRegistro      = p_rec_ipModificacion);


	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT dr.det_idDetalleReclamo,
		   (select s.sol_descripcion 
		                         from TB_REC_CAT_Solucionadores s 
								where s.sol_idSolucionador = dr.det_idSolucionador ) INTO v_id_detalle_reclamo_actual, v_desSolucionador
	  FROM TB_REC_DET_detallesReclamos dr
	 WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;
  
  
	    
	   UPDATE TB_REC_DET_detallesReclamos
          SET det_AnalisisArea = p_solucion_problema
        WHERE det_idSolucionador = p_id_solucionador-- 1
         AND det_idReclamo      = p_id_reclamo-- 2
	     AND det_estado  = 1;
	
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	select r.rec_solucionProblema into v_analisisArea
	 from TB_REC_MAE_Reclamos r
	 where r.rec_idReclamo = p_id_reclamo;
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	select v_analisisArea;
	
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	set v_analisisArea = ifnull(v_analisisArea,' '); 

     UPDATE TB_REC_MAE_Reclamos
        SET rec_solucionProblema = v_analisisArea + char(10) +' - '+ v_desSolucionador +' : '+p_solucion_problema-- SQLINES DEMO *** har(10) + @desSolucionador +' : ' +@solucion_problema
	 where rec_idReclamo = p_id_reclamo;
	 /* SQLINES DEMO *** Reclamo, rec_solucionProblema from TB_REC_MAE_Reclamos r  where rec_idReclamo = 1
	 select * from TB_REC_DET_detallesReclamos where det_idSolucionador = 8 and det_estado = 1
	 */
     UPDATE TB_REC_DET_imagenesDetalles
	    SET img_idDetalleReclamo = v_id_detalle_reclamo_actual 
	  WHERE img_idDetalleReclamo = v_id_detalle_reclamo;
     
end;













END ;;
