CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_Motivo`(
	p_mot_idMotivo bigint,
	p_mot_idProducto bigint,
	p_mot_descripcion varchar(50),
	p_mot_estado nchar(1),	
	p_mot_usuarioModificacion varchar(50),
	p_mot_ipModificacion varchar(15),
	p_mot_fechaModificacion date,
	p_mot_DiasSuper bigint,
	p_mot_diasMax int)
BEGIN
UPDATE TB_REC_MAE_Motivos SET
	`mot_idProducto` = p_mot_idProducto,
	`mot_descripcion` = p_mot_descripcion,
	`mot_estado` = p_mot_estado,		
	`mot_usuarioModificacion` = p_mot_usuarioModificacion,
	`mot_ipModificacion` = p_mot_ipModificacion,
	`mot_fechaModificacion` = p_mot_fechaModificacion,
	`mot_DiasSuper` = p_mot_DiasSuper,
	`mot_DiasMaximo` = p_mot_diasMax
	
WHERE
	`mot_idMotivo` = p_mot_idMotivo;















END ;;
