CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_OficialReclamo`(
	-- SQLINES DEMO *** s for the stored procedure here
	p_id_reclamo              int /* = null */ ,
	p_correo                  varchar(50) /* = null */ ,
	p_id_ofi_orig_reclamo     int /* = null */ ,
	p_nombre_ofi_orig_reclamo varchar(50)/* = null */ ,
	p_id_estado_reclamo       int /* = null */ ,
	p_id_fav_desf             int /* = null */ ,
	p_id_riesgo               int /* = null */ ,
	p_accion_operativa        longtext /* = null */ ,
	p_accion_administ         longtext /* = null */ ,
	p_estado_mejora           longtext /* = null */ ,
	p_solucion_problema		 longtext /* = null */ ,
	p_contestacion_cliente    longtext /* = null */ ,
	p_usuario_modificacion    varchar(50) /* = null */ ,
	p_ip_modificacion         varchar(50) /* = null */ ,
	p_opcion                  int /* = null */ ,
	p_id_detalle_reclamo		 int /* = null */ ,
	p_id_imagen               int /* = null */ ,
	p_idMotivo                int /* = null */ ,
	p_notificar				 tinyint /* = null */ ,
	--  SQLINES DEMO ***  bit = null
	-- nuevos parametros
	p_id_forma_devolucion	bigint /* = 0 */ ,
    p_idMotivoEliminacion   bigint,  
	p_monto_devolucion		decimal(18,0) /* = 0 */,
    p_encuesta varchar(100))
BEGIN

DECLARE v_dias_utilizados int;
DECLARE v_motivo int;
DECLARE v_fecha_estimada_sol date;

BEGIN

	if p_opcion = 1
	THEN
	    if p_idMotivo = 0
		THEN
			UPDATE TB_REC_MAE_Reclamos 
			   SET rec_Correo                      = AES_ENCRYPT(p_correo, 'Pa$$'),
			   	   rec_numeroOficinaOrigenReclamo  = p_id_ofi_orig_reclamo,
			   	   rec_nombreOficinaOrigenReclamo  = p_nombre_ofi_orig_reclamo,
			   	   rec_EstadoReclamo               = p_id_estado_reclamo,
			   	   rec_FavorableDesfavorable       = p_id_fav_desf,
			   	   rec_riesgo                      = p_id_riesgo,
			   	   rec_accionOperativa             = p_accion_operativa,
			   	   rec_accionesAdministrativas     = p_accion_administ,
			   	   rec_EstadoMejorasProceso        = p_estado_mejora,
			   	   rec_solucionProblema            = p_solucion_problema,
			   	   rec_ContestacionCliente         = p_contestacion_cliente,
			   	   rec_notificar				   = p_notificar,
			   	   rec_usuarioModificacion         = p_usuario_modificacion,
			   	   rec_ipModificacion              = p_ip_modificacion,
                   rec_idMotivoEliminacion         = p_idMotivoEliminacion,
			   	   rec_fechaModificacion           = NOW(3),
				   --  SQLINES DEMO ***   = @destinodefensor
				   --  SQLINES DEMO *** 021
				   rec_id_forma_devolucion		   = p_id_forma_devolucion,
				   rec_montoDevolucion			   = p_monto_devolucion	,
                   rec_linkEncuesta				= IFNULL(p_encuesta, rec_linkEncuesta)
		 WHERE rec_idReclamo  = p_id_reclamo;
		ELSE
			UPDATE TB_REC_MAE_Reclamos 
			   SET rec_Correo                      = AES_ENCRYPT(p_correo, 'Pa$$'),
			   	   rec_numeroOficinaOrigenReclamo  = p_id_ofi_orig_reclamo,
			   	   rec_nombreOficinaOrigenReclamo  = p_nombre_ofi_orig_reclamo,
			   	   rec_EstadoReclamo               = p_id_estado_reclamo,
			   	   rec_FavorableDesfavorable       = p_id_fav_desf,
			   	   rec_riesgo                      = p_id_riesgo,
			   	   rec_accionOperativa             = p_accion_operativa,
			   	   rec_accionesAdministrativas     = p_accion_administ,
			   	   rec_EstadoMejorasProceso        = p_estado_mejora,
			   	   rec_solucionProblema            = p_solucion_problema,
			   	   rec_ContestacionCliente         = p_contestacion_cliente,
			   	   rec_idMotivo					   = p_idMotivo,
			   	   rec_notificar				   = p_notificar,
			   	   rec_usuarioModificacion         = p_usuario_modificacion,
			   	   rec_ipModificacion              = p_ip_modificacion,
			   	   rec_fechaModificacion           = NOW(3),
				   --  SQLINES DEMO ***   = @destinodefensor
				   --  SQLINES DEMO *** 021
				   rec_id_forma_devolucion		   = p_id_forma_devolucion,
                   rec_idMotivoEliminacion         = p_idMotivoEliminacion,
				   rec_montoDevolucion			   = p_monto_devolucion,
                   rec_linkEncuesta				= IFNULL(p_encuesta, rec_linkEncuesta)
			  WHERE rec_idReclamo  = p_id_reclamo;
		END IF;
		
	END IF;
	
	if p_opcion = 2 
	THEN 
		UPDATE TB_REC_DET_imagenesDetalles 
		   SET img_imprimir            = 1,
		       img_usuarioModificacion = p_usuario_modificacion,
			   img_ipModificacion      = p_ip_modificacion,
			   img_fechaModificacion   = NOW(3)
		 WHERE img_idImagen = p_id_imagen;
	END IF;

	if p_opcion = 3 
	THEN 
		UPDATE TB_REC_DET_ImagenesOficial 
		   SET imo_imprimir = 1,
		       imo_usuarioModificacion = p_usuario_modificacion,
			   imo_ipModificacion      = p_ip_modificacion,
			   imo_fechaModificacion   = NOW(3)
		 WHERE  imo_idIimagenOficial = p_id_imagen;
	END IF;
	
	if p_id_estado_reclamo  = 4
	THEN
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
		SELECT TIMESTAMPDIFF(day,r.rec_FechaIngreso,NOW(3)) INTO v_dias_utilizados
		FROM TB_REC_MAE_Reclamos r
		WHERE rec_idReclamo  = p_id_reclamo;
		UPDATE TB_REC_MAE_Reclamos 
		   SET rec_fechaSolucionReclamo  = NOW(3),
			   rec_diasUtilizados        = v_dias_utilizados,
			   rec_usuarioModificacion   = p_usuario_modificacion,
			   rec_ipModificacion        = p_ip_modificacion,
			   rec_fechaModificacion     = NOW(3),
			   --  SQLINES DEMO ***  usuario de cierre
			   rec_fechaCierre = NOW(3),
			   rec_usuarioCierre = p_usuario_modificacion
			   -- 
		 WHERE rec_idReclamo  = p_id_reclamo;
	END IF;

	--  SQLINES DEMO *** onador, nuevo tiempo de revisiÃ³n configurado 
	if p_id_estado_reclamo  = 2
	THEN
		-- SQLINES LICENSE FOR EVALUATION USE ONLY
		SELECT r.rec_idMotivo INTO v_motivo
		FROM TB_REC_MAE_Reclamos r
			WHERE rec_idReclamo  = p_id_reclamo;

		-- SQLINES LICENSE FOR EVALUATION USE ONLY
		SELECT TIMESTAMPADD(DAy,m.mot_DiasMaximo, NOW(3)) INTO v_fecha_estimada_sol
			FROM TB_REC_MAE_Motivos m
			WHERE m.mot_idMotivo  = v_motivo;

		UPDATE TB_REC_MAE_Reclamos 
		   SET rec_fechaEstimadaSolucion  = v_fecha_estimada_sol
		 WHERE rec_idReclamo  = p_id_reclamo;

	END IF;
END;


END ;;
DELIMITER ;
