CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_OficialSolucionador`(
	p_id_reclamo          int /* = null */,
	p_id_solucionador     int /* = null */,
	p_id_estado           int /* = null */,
	p_usuarioModificacion varchar(50) /* = null */,
	p_ipModificacion		 varchar(15) /* = null */)
BEGIN

 DECLARE v_return_value int;
 DECLARE v_id_detalle_reclamo        int;
 DECLARE v_id_detalle_reclamo_actual int;
 DECLARE v_solucion_problema         longtext;
BEGIN
	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.
	
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	SELECT dr.det_idDetalleReclamo,
		   dr.det_AnalisisArea INTO v_id_detalle_reclamo, v_solucion_problema
	  FROM TB_REC_DET_detallesReclamos dr
	 WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;

	 UPDATE TB_REC_DET_detallesReclamos
       SET det_estado = 0,
	       det_fechaModificacion = NOW(3),
	       det_usuarioModificacion = p_usuarioModificacion,
	       det_ipModificacion  = p_ipModificacion
     WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado         = 1;

	CALL /*@return_value    =*/ `dbo`.`SP_REC_ING_DetalleReclamo`
		 (v_id_reclamo      = p_id_reclamo,
		 p_id_solucionador = p_id_solucionador,
		 p_id_estado       = p_id_estado,
		 p_usuarioRegistro = p_usuarioModificacion,
		 p_ipRegistro      = p_ipModificacion);


    -- SQLINES LICENSE FOR EVALUATION USE ONLY
    SELECT dr.det_idDetalleReclamo INTO v_id_detalle_reclamo_actual 
	  FROM TB_REC_DET_detallesReclamos dr
	 WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;
	-- RETURN @return_value
    UPDATE TB_REC_DET_detallesReclamos
       SET det_AnalisisArea = v_solucion_problema
     WHERE det_idSolucionador = p_id_solucionador-- 1
       AND det_idReclamo      = p_id_reclamo-- 2
	   AND det_estado  = 1;

    UPDATE TB_REC_DET_imagenesDetalles
	    SET img_idDetalleReclamo = v_id_detalle_reclamo_actual 
	  WHERE img_idDetalleReclamo = v_id_detalle_reclamo;
  

     if not exists (SELECT 1 FROM TB_REC_DET_detallesReclamos dr
	                 WHERE dr.det_idReclamo = p_id_reclamo
	                   AND dr.det_estadoReclamo  in(2,6)  --  SQLINES DEMO *** doReclamo = 6 
					   AND dr.det_estado = 1
				    )--  SQLINES DEMO *** TADO EN PENDIENTE DE SOLUCION O REASIGNADO
	THEN 
	    UPDATE TB_REC_MAE_Reclamos
		   SET rec_EstadoReclamo = 3,
		       rec_fechaModificacion = NOW(3),
			   rec_usuarioModificacion = p_usuarioModificacion,
			   rec_ipModificacion      = p_ipModificacion
		 WHERE rec_idReclamo = p_id_reclamo;
	ELSE
	     UPDATE TB_REC_MAE_Reclamos
		   SET rec_EstadoReclamo = 2,
		       rec_fechaModificacion = NOW(3),
			   rec_usuarioModificacion = p_usuarioModificacion,
			   rec_ipModificacion      = p_ipModificacion
		 WHERE rec_idReclamo = p_id_reclamo;
	END IF;
	/* SQLINES DEMO *** o.TB_REC_DET_detallesReclamos dr
	                 WHERE dr.det_idReclamo = 2
					  AND dr.det_estado    = 2 or DR.det_estado = 6
   SELECT * FROM TB_REC_DET_Catalogos c
   WHERE c.cat_idTipoCatalogo = 1*/
END;














END ;;
