		  SELECT @count = COUNT (1)  FROM TB_REC_DET_ProductoBanCompuesto p WHERE p.pbc_idProducto = @id_ProductoExite

		 IF (@count = 1)
		 BEGIN
			 UPDATE TB_REC_MAE_Productos 
