BEGIN

declare v_id_ProductoExite int;
        declare v_count            int;

BEGIN

	-- SQLINES DEMO *** ded to prevent extra result sets from
	-- SQLINES DEMO *** SELECT statements.

	IF EXISTS ( SELECT 1 
				  FROM TB_REC_DET_ProductoCompuesto pc
				 WHERE pc.pc_idProductoCompuesto = p_id_producto
				 )
	THEN
		UPDATE TB_REC_DET_ProductoCompuesto
	       SET pc_estado  = 0
	     WHERE pc_idProductoCompuesto = p_id_producto;

		 -- SQLINES LICENSE FOR EVALUATION USE ONLY
 		SELECT pr.pc_idProducto INTO v_id_ProductoExite
		   FROM TB_REC_DET_ProductoCompuesto pr
		  WHERE pc_idProductoCompuesto = p_id_producto;

		  -- SQLINES LICENSE FOR EVALUATION USE ONLY
  		SELECT COUNT (1) INTO v_count  FROM TB_REC_DET_ProductoCompuesto p WHERE p.pc_idProducto = v_id_ProductoExite;

		 IF (v_count = 1)
		 THEN
			 UPDATE TB_REC_MAE_Productos 
			   SET pro_compuesto = 0
			 WHERE pro_idProducto = p_id_producto;
		 END IF;
	END IF;

	if EXISTS ( SELECT 1
	              from TB_REC_DET_ProductoCompuesto p
	             WHERE p.pc_idProducto = p_id_producto
	               and p.pc_idProductoCompuesto = p_id_productoCompuesto
				   )
	THEN
		UPDATE TB_REC_DET_ProductoCompuesto 
		   SET pc_estado              = 1,-- @estado,
			   pc_usuarioModificacion = p_usuarioModificacion,
			   pc_ipModificacion      = p_ipModificacion,
			   pc_fechaModificacion   = NOW(3)
		 WHERE pc_idProducto = p_id_producto
		   and pc_idProductoCompuesto = p_id_productoCompuesto;

		UPDATE TB_REC_MAE_Productos 
		   SET pro_compuesto = 1
		 WHERE pro_idProducto = p_id_producto;
		 /* SQLINES DEMO *** TB_REC_MAE_Productos  WHERE pro_idProducto = 3
		 SELECT * FROM TB_REC_DET_ProductoCompuesto WHERE pc_idProducto = 3 AND pc_idProductoCompuesto = 6*/
	else
	   insert into TB_REC_DET_ProductoCompuesto
	         (pc_idProducto,pc_idProductoCompuesto,pc_estado,pc_usuarioRegistro,pc_ipRegistro,pc_fechaRegistro )
       values(p_id_producto,p_id_productoCompuesto,1, p_usuarioModificacion,p_ipModificacion,NOW(3)); 

	    UPDATE TB_REC_MAE_Productos  
 	     SET pro_compuesto  = 1
	   WHERE pro_idProducto = p_id_producto;
	END IF;
	  
END;














END ;;
