CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_REC_MOD_RolMenu`(
	-- SQLINES DEMO *** s for the stored procedure here
	p_idMenu                  int,
    p_idRol                   int,
	p_usuarioModificacion     varchar(50),
    p_creacion                tinyint,
    p_edicion                 tinyint,
    p_elimininacion           tinyint,
    p_imprimir                tinyint,
    p_guardar                 tinyint,    
	p_estado                  tinyint,
    p_tipo                    int)
BEGIN
        DECLARE v_idPadre INT;
        
        SET v_idPadre = (SELECT m.menu_idPadre FROM TB_REC_MAE_Menu m WHERE m.menu_idMenu = p_idMenu);
        IF p_tipo = 1 --  ACTULIZACION SOLO DEL CAMPO ESTADO
        THEN
            UPDATE TB_REC_DET_RolMenu
			SET 
              mrol_usuarioModificacion = p_usuarioModificacion, 
              mrol_fechaModificacion = NOW(3), 
              mrol_estado = p_estado
			WHERE mrol_idMenu = p_idMenu
              AND mrol_idRol = p_idRol;
		END IF;
        
        IF p_tipo = 2 --  ACTULIZACION SOLO DEL CAMPO ESTADO
        THEN
            UPDATE TB_REC_DET_RolMenu
			SET 
              mrol_usuarioModificacion = p_usuarioModificacion, 
              mrol_fechaModificacion = NOW(3), 
              mrol_estado = p_estado,
              mrol_edicion = p_edicion,
			  mrol_creacion = p_creacion,
			  mrol_eliminacion = p_elimininacion,
			  mrol_imprimir = p_imprimir,
			  mrol_guardar = p_guardar
			WHERE mrol_idMenu = p_idMenu
              AND mrol_idRol = p_idRol;
		END IF;
			IF NOT EXISTS
            (
                SELECT * FROM TB_REC_MAE_Menu m
                    JOIN TB_REC_DET_RolMenu rm ON rm.mrol_idMenu = m.menu_idMenu
				WHERE m.menu_idPadre = v_idPadre
                  AND rm.mrol_estado = 1
				  AND rm.mrol_idRol = p_idRol
			)
            THEN
                IF p_tipo = 1 --  ACTULIZACION SOLO DEL CAMPO ESTADO
                THEN
                   UPDATE TB_REC_DET_RolMenu
                      SET 
                         mrol_usuarioModificacion = p_usuarioModificacion, 
                         mrol_fechaModificacion = NOW(3), 
                         mrol_estado = p_estado
					  WHERE mrol_idMenu = v_idPadre
                           AND mrol_idRol = p_idRol;
				END IF;
                
                IF p_tipo = 2 --  ACTULIZACION SOLO DEL CAMPO ESTADO
                THEN
                   UPDATE TB_REC_DET_RolMenu
                      SET 
                         mrol_usuarioModificacion = p_usuarioModificacion, 
                         mrol_fechaModificacion = NOW(3), 
                         mrol_estado = p_estado,
                         mrol_edicion = p_edicion,
                         mrol_creacion = p_creacion,
                         mrol_eliminacion = p_elimininacion,
                         mrol_imprimir = p_imprimir,
                         mrol_guardar = p_guardar
					  WHERE mrol_idMenu = v_idPadre
                           AND mrol_idRol = p_idRol;
				END IF;
		ELSE
            IF p_tipo = 1
            THEN
                UPDATE TB_REC_DET_RolMenu
                  SET 
                      mrol_usuarioModificacion = p_usuarioModificacion, 
                      mrol_fechaModificacion = NOW(3), 
                      mrol_estado = 1
                WHERE mrol_idMenu = v_idPadre
                      AND mrol_idRol = p_idRol;
			END IF;
            
            IF p_tipo = 2
            THEN
                UPDATE TB_REC_DET_RolMenu
                  SET 
                      mrol_usuarioModificacion = p_usuarioModificacion, 
                      mrol_fechaModificacion = NOW(3), 
                      mrol_estado = 1,
                      mrol_edicion = p_edicion,
                      mrol_creacion = p_creacion,
                      mrol_eliminacion = p_elimininacion,
                      mrol_imprimir = p_imprimir,
                      mrol_guardar = p_guardar
                WHERE mrol_idMenu = v_idPadre
                      AND mrol_idRol = p_idRol;
			END IF;
        END IF;
    END ;;
DELIMITER ;
