CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_verificarProductoSolucionador`( p_idPorducto int,p_idsolucionador int)
begin
	-- SQLINES LICENSE FOR EVALUATION USE ONLY
	select 1 from TB_REC_MAE_Productos p
	join TB_REC_DET_productoSolucionadores ps
	on p.pro_idProducto = p_idPorducto
	and ps.ps_idSolucionador=p_idsolucionador
	limit 1;
 end ;;
